INSERT INTO `ability` VALUES
(1,1,'Berserker\'s Call','Axe taunts nearby enemy units, forcing them to attack him while he gains bonus armor during the duration.',NULL,'Mogul Khan\'s warcry taunts opponents into engaging in an unconquerable battle with the Axe.','https://www.dotabuff.com/assets/skills/axe-berserkers-call-5007-f30d7f95a1a6ae8c45eb5b8f323b9a7148f6bcb3f7c74121d5746310f203b562.jpg'),
(2,1,'Battle Hunger','Enrages an enemy unit, causing it to take damage over time until it kills another unit or the duration ends. The damage is increased by a factor of Axe\'s armor. The enemy is also slowed as long as they are facing away from Axe.','Destroying buildings will also remove the debuff.','Ordinary heroes cannot withstand Mogul Khan\'s rage for battle, such that it injures them until it is satisfied.','https://www.dotabuff.com/assets/skills/axe-battle-hunger-5008-ecac4583b6dbd88ae530922fbfb8beceefb8997472e22bb62f58008c749c97ce.jpg'),
(3,1,'Counter Helix','After a set number of attacks, Axe will perform a helix counter attack, dealing pure damage to all nearby enemies.','Counter Helix triggers when the attack hits.Illusions\' counters don\'t increase when they attack when you have a Scepter.','Axe is the only reinforcement this army needs.','https://www.dotabuff.com/assets/skills/axe-counter-helix-5009-b77d885afc3c807552246304350a9aa22732196915dedfde9e545f8cd0c29633.jpg'),
(4,1,'Culling Blade','Axe spots a weakness and strikes, dealing pure damage. When an enemy hero is killed with Culling Blade, its cooldown is reset, and all nearby allied units gain bonus movement speed and armor.','Culling Blade death cannot be prevented with other abilities like Shallow Grave.','Mogul Khan is the embodiment of battle and fury, launching into a gruesome fatality against those who dare engage the Axe in combat.','https://www.dotabuff.com/assets/skills/axe-culling-blade-5010-e6a8712ccd92e6fa17617dcb9b56e0005f6c720e24bc7d5967ab9ab26d1bc93c.jpg'),
(5,1,'Coat of Blood','Whenever Axe gets a kill, he permanently gains 0.2 / 0.3 / 0.4 / 0.5 armor. Killing with Culling Blade gives 3x that amount.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(6,2,'Flux','Infuses a lone enemy unit with swirling, volatile energy, dealing damage over time and slowing the target. The damage is not applied if another enemy unit is near the target.',NULL,'An infinitesimal fraction of the power which imprisoned the Ancients.','https://www.dotabuff.com/assets/skills/arc-warden-flux-5677-1e7c240f619d743a420e8e6400b11433e0c3961ee7b85dda84a38a1478fffe98.jpg'),
(7,2,'Magnetic Field','Arc Warden generates a circular distortion field of magnetic energy around themself.',NULL,'Time and space are of little consequence to one as old as Zet.','https://www.dotabuff.com/assets/skills/arc-warden-magnetic-field-5678-5e1f747c0cdb121ecc3bb6ae4ae58bc765a44805cec2dfcd53e867f3a3d81da2.jpg'),
(8,2,'Spark Wraith','Summons a Spark Wraith that slowly materializes and patrols a targeted area until an enemy comes within its range. Once a target has been found the wraith fuses with them, dealing magical damage and slowing the unit. Non-hero units receive 40% more damage.','Spark Wraiths can not be disjointed.','Lesser fragments of Zet\'s original self.','https://www.dotabuff.com/assets/skills/arc-warden-spark-wraith-5679-278c0ac605e5a3a213ffbf4cd7d85bf4fe5d31ed85cc934a04a0a9ce93b9ab27.jpg'),
(9,2,'Runic Infusion','Upon activating any rune, gain the Regeneration Rune buff for 4s.','Has 67% duration when activating a Bounty or Water rune.',NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(10,2,'Tempest Double','Briefly refocusing its fractured elements into a single form, the Arc Warden is able to create a perfect electrical duplication of itself. The duplicate can use all of Arc Warden\'s current items and special Tempest Double versions of his spells, except most consumables and items that drop on death. The duplicate has separate item and ability cooldowns.If killed by the enemy, the Tempest Double gives bounty gold to enemies, and the ability\'s cooldown is restarted.The Tempest Double loses its sense of self if he is too far away from Arc Warden and takes more damage.','Tempest Double and Refresher Orb cannot be used by the duplicate.','Warped by the power of its peers, Arc Warden becomes what it despises most: disharmony.','https://www.dotabuff.com/assets/skills/arc-warden-tempest-double-5683-950fe336a6d91d90ca0c23ba456142a19918167fee4871dcc4695a1b22969112.jpg'),
(11,3,'Avalanche','Bombards an area with rocks, continously doing small intervals of damage and stun to enemy units. Avalanche does 100% bonus damage to units being tossed',NULL,'Inanimate rock becomes animate when called by the Stone Giant.','https://www.dotabuff.com/assets/skills/tiny-avalanche-5106-4af121d1997cf92788218a7693e7d8e4ecadaa2974d6a9c822700287a272de6e.jpg'),
(12,3,'Toss','Grabs the nearest unit in a 300 radius around Tiny, ally or enemy, and launches it at the target unit or rune to deal damage where they land.','You can toss allies, but they don\'t take damage.Toss deals 33% of its damage to buildings.Debuff Immune units can be targeted but cannot be tossed.','Tiny\'s gargantuan stature allows him to catapult even the sturdiest of warriors.','https://www.dotabuff.com/assets/skills/tiny-toss-5107-56d931b0f2bcdd00f0117b5045ad111ec1d34600846c0caad9eb22ccc68fda5d.jpg'),
(13,3,'Tree Grab','Grabs a tree to whack enemies on the head for a limited number of attacks. Grants bonus attack range. Attacks deal more damage and fully splash on units along the way. The tree can be thrown, to deal your attack to a unit at a distance.','The cooldown begins when the tree is thrown.','Sticks and stones break all the bones, with structures sure to follow.','https://www.dotabuff.com/assets/skills/tiny-tree-grab-5108-ffad5684b3fe98f0ddd597f33f1a3550057d41f74aaceee0be0a77547ff57864.jpg'),
(14,3,'Tree Volley','CHANNELED - Tiny channels to throw random trees within range towards the targeted area. Deals Tiny\'s attack damage to enemies in that area with each tree thrown.',NULL,'Sticks thrown from stones are like to shatter many bones.','https://www.dotabuff.com/assets/skills/tiny-tree-volley-7850-be97ac936168e834bb0bc89fd517e641ba186852265ddd6c108d7b9903f5fe27.jpg'),
(15,3,'Craggy Exterior','Enemies that attack Tiny receive a stacking debuff that lowers their attack damage with each stack.','Break disables the application of new stacks.Break does not disable the effects of existing stacks.',NULL,'https://www.dotabuff.com/assets/skills/tiny-craggy-exterior-296-3fbf9416a63fd283465abcba93ff9170112aced3edb755e487d38e6b915600a3.jpg'),
(16,3,'Grow','Tiny gains craggy mass, increasing his attack damage, movement speed and armor, and toss power while slowing his attack speed.',NULL,'Watching a hill become a mountain is awe-inspiring - especially if the mountain begins laying waste to adversaries.','https://www.dotabuff.com/assets/skills/tiny-grow-5109-184ec47fc5b342cb63dd63fb34fa4d679e82b569074b35e4eaa83d2bed66ce0f.jpg'),
(17,3,'Tree Throw','Throws the tree at the target unit, proccing your attack on it and splashing damage around the target.',NULL,'Even enemies can share in Tiny\'s arbor ardor.','https://www.dotabuff.com/assets/skills/tiny-tree-throw-6937-8e8799047a5fd557fcadc51c4178ae3ad3350ad25f857e0e5d08c0c74daabd13.jpg'),
(18,4,'Spectral Blade','Curses units that Wraith King attacks, dealing a flat amount of damage and a percentage of the attack damage again after a delay. Vampiric Spirit\'s lifesteal applies to the curse damage and a unit cannot be cursed again for a short period of time.',NULL,NULL,'https://www.dotabuff.com/assets/skills/wraith-king-spectral-blade-1282-9be039101fbd3bceec3816e9221529a6dd5b2bb0bcbc02ca0aeb147a0a6a4b7b.jpg'),
(19,4,'Wraithfire Blast','Wraith King sears an enemy unit with spectral fire, dealing damage and stunning, then dealing damage over time and slowing the target.',NULL,'Ostarion calls on his damned lineage, laying waste to his opponents.','https://www.dotabuff.com/assets/skills/wraith-king-wraithfire-blast-5086-81e37fb221081813313f8c04411fd1c802712026021ec96a2f55ef37ed407269.jpg'),
(20,4,'Bone Guard','Gains a Charge for every 2 units killed. Activate to spend all charges, summoning skeletons that respawn once when killed. Skeletons benefit from Vampiric Spirit\'s lifesteal.','Break disables the gaining of new stacks.','Wraith King\'s blade drains his enemy\'s essence to feed his aura.','https://www.dotabuff.com/assets/skills/wraith-king-bone-guard-5087-68e6621d740b53541d6028825b9881b332dc6b4a3ce8d3201022a434b494cf72.jpg'),
(21,4,'Mortal Strike','Wraith King passively deals bonus damage on an attack with a cooldown.',NULL,'One blow to crush a foe.','https://www.dotabuff.com/assets/skills/wraith-king-mortal-strike-5088-34dec6cd564742809aa4f5280b8ee5e5921c69924cc5852fb791bd22f6a7df8f.jpg'),
(22,4,'Vampiric Spirit','Grants Wraith King Lifesteal. When slain Wraith King turns into a free pathing Wraith with Bonus Attack and Movement Speed for a short duration, delaying his death.','Credit for allies whose death was delayed will go to whoever struck the original killing blow.Does not affect Reincarnate deaths.Lifesteal from creeps is reduced by 40%.Break only disables the passive lifesteal component.Respawn timer is reduced by Wraith duration.',NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(23,4,'Reincarnation','Wraith King\'s form regroups after death, allowing him to resurrect when killed in battle.  Upon death, enemy units in a 900 radius are slowed. Can be self-cast to kill Wraith King instantly.','Wraith King won\'t revive if he doesn\'t have enough mana.If Wraith King has an Aegis and Reincarnation off cooldown, Reincarnation will trigger first.Revives with full HP and Mana.','Conspirators against the Wraith King wonder why he never stays dead.','https://www.dotabuff.com/assets/skills/wraith-king-reincarnation-5089-4206b2ef2dde93f14327f94d961f8742c40e31979b76c04f5259dce599e4b05d.jpg'),
(24,5,'Shadowraze','Shadow Fiend razes the ground directly in front of him, dealing damage to enemy units in the area. Adds a stacking damage amplifier on the target that causes the enemy to take bonus Shadowraze damage per stack.','Stack duration refreshes on stack gain.','Nevermore\'s trademark for harvesting souls.','https://www.dotabuff.com/assets/skills/shadow-fiend-shadowraze-5059-af373ccbf69c45bf65c945b0601d288cb1ac553a2188c990b953e95920a2f185.jpg'),
(25,5,'Shadowraze','Shadow Fiend razes the ground a short distance away from him, dealing damage to enemy units in the area. Adds a stacking damage amplifier on the target that causes the enemy to take bonus Shadowraze damage per stack.','Stack duration refreshes on stack gain.','Nevermore\'s trademark for harvesting souls.','https://www.dotabuff.com/assets/skills/shadow-fiend-shadowraze-5060-665a45f3f65842ed715d82a53cfff176fa1e78f1481e1e75bc66518856fb4497.jpg'),
(26,5,'Shadowraze','Shadow Fiend razes the ground a longer distance away from him, dealing damage to enemy units in the area. Adds a stacking damage amplifier on the target that causes the enemy to take bonus Shadowraze damage per stack.','Stack duration refreshes on stack gain.','Nevermore\'s trademark for harvesting souls.','https://www.dotabuff.com/assets/skills/shadow-fiend-shadowraze-5061-461fa411edb56b272e2d58eb33a0fb9f0b4da9d35704162ddf68bc64f18353eb.jpg'),
(27,5,'Feast of Souls','Shadow Fiend gains Bonus Attack Speed for 8 seconds. After the effect finishes, Shadow Fiend loses a fixed amount of souls.','Cannot be cast unless Shadow Fiend has enough souls to pay the cost.',NULL,'https://www.dotabuff.com/assets/skills/shadow-fiend-feast-of-souls-1216-1f0b463b13957181f10e5421b47b3b182d77348ca0ee9741373cd59fb0387e6d.jpg'),
(28,5,'Presence of the Dark Lord','Shadow Fiend\'s presence reduces the armor of nearby enemies.','Stacks fully with other armor reduction abilities and aura.','Even being near Nevermore eats away at one\'s soul.','https://www.dotabuff.com/assets/skills/shadow-fiend-presence-of-the-dark-lord-5063-642a795d80563e36380c69a972f818aca455afa53520d57cc77500f8569e4760.jpg'),
(29,5,'Requiem of Souls','Shadow Fiend gathers his captured souls to release them as lines of demonic energy. Units near Shadow Fiend when the souls are released can be damaged by several lines of energy. Any unit damaged by Requiem of Souls will be feared and have its movement speed and magic resistance reduced for 0.6 seconds for each line hit up to a maximum of 2.15. Lines of energy are created for every soul captured through Necromastery.  Requiem of Souls is automatically cast whenever Shadow Fiend dies, regardless of its cooldown.','One line is generated from Shadow Fiend for every 1 soul in his possession.Fear and movement slow do not apply if the Requiem was released on death.','The captured souls of those past slain are released to ravage their former allies.','https://www.dotabuff.com/assets/skills/shadow-fiend-requiem-of-souls-5064-aeff4750a7b0db186d7d987f7fb3a05c6b6971ce2f288286eff7f93426e8e4ed.jpg'),
(30,5,'Necromastery','Shadow Fiend steals the soul from units he kills, gaining bonus damage. On death, he releases 30% of them from bondage.','Denies and neutral creeps also provide bonus damage through Necromastery.Break disables the gaining of new stacks.Break does not disable the bonuses from existing stacks.','Harvested souls swirl in and out of the Abysm, empowering the Shadow Fiend to increase the size of his collection.','https://www.dotabuff.com/assets/skills/shadow-fiend-necromastery-5062-411947d28ac6973151d927c403211b8cd7817dba05569ce48c57fcdf676c7247.jpg'),
(31,6,'Burrowstrike','Sand King burrows into the ground and tunnels forward, damaging and stunning enemy units above him as he resurfaces. Adds Caustic Finale poison to heroes hit Can be put on alt-cast to immediately cast in the desired direction, without walking towards the targeted location.','Does not trigger spell block or spell reflect.','Crixalis often lies in wait, burrowing under the surface to ambush his adversaries.','https://www.dotabuff.com/assets/skills/sand-king-burrowstrike-5102-2a5a66e616479b86011e5bd735affddd6255d6e5a21cbe06130369707423d432.jpg'),
(32,6,'Sand Storm','Sand King creates a fearsome sandstorm that damages enemy units. The effect ends when Sand King leaves the area.','Sand Storm can be used to dodge projectiles.Sand King briefly becomes visible upon attacking or using spells while in Sand Storm. Sand King will become invisible again in -1 seconds.','Some say Crixalis is a mirage; his carapace appearing then vanishing between the whirling sands of the Scintillant Waste.','https://www.dotabuff.com/assets/skills/sand-king-sand-storm-5103-d7903f6ed10b166f8aed89c3b286ba42bbd1261e1dd0420404064bb089f3e172.jpg'),
(33,6,'Stinger','Sand King strikes an area, performing an attack on all enemies in the area of effect, dealing extra damage to each. Enemies within an innermost radius of 125 take 40% extra damage. Applies Caustic Finale and a slow to all enemies hit.',NULL,NULL,'https://www.dotabuff.com/assets/skills/sand-king-stinger-1229-153a7f38ae74f69c65d412d07c45a6ec9684b1b806602b64b2ee75b3ab725369.jpg'),
(34,6,'Caustic Finale','Sand King\'s attacks inject a venom that causes enemy units to violently explode when they die.',NULL,'An injection from Crixalis makes one brittle and as dry as the arid wastes, subject to implosive demise.','https://www.dotabuff.com/assets/skills/sand-king-caustic-finale-1226-be7a236878afd4d1bb5c31baf4998f2c7ebef5705e0523b7a3102bd96fdd8314.jpg'),
(35,6,'Epicenter','After a cast point of 2 seconds, Sand King sends a disturbance into the earth, causing it to shudder violently. All enemies caught within range will take damage and become slowed. Each subsequent pulse increases the radius of damage dealt.','The pulses are centered on Sand King, not where he first cast the spell.','Many an explorer was lost to the quicksands of the Scintillant Waste.','https://www.dotabuff.com/assets/skills/sand-king-epicenter-5105-248c7aa71b74344875c729918d50f5398f711382036e459935e72ae9cadd25c1.jpg'),
(36,7,'Fatal Bonds','Binds several enemy units together, causing a percentage of the damage dealt to one of them to be felt by the others.','The shared damage type is the same as the type of damage inflicted.','An ancient incantation that links the vital energies of multiple lifeforms into one collective body.','https://www.dotabuff.com/assets/skills/warlock-fatal-bonds-5162-dd5834fb6cdfc8bb0ddae069a0d37260bcd3e655de72a339179de612c67c0822.jpg'),
(37,7,'Shadow Word','Warlock whispers an incantation, casting a spell on a unit that makes it deal damage to nearby enemy units and heal nearby ally units. Target Unit will also heal or be damaged depending on whether they are ally or enemy.',NULL,'Demnok\'s arcane arts have a myriad of uses, allowing them to be powerful friendly enchantments or damaging curses.','https://www.dotabuff.com/assets/skills/warlock-shadow-word-5163-5f9ba807fd42834de27487b89694e2ab4182d5d2b93db171e2cd46067e92d44f.jpg'),
(38,7,'Upheaval','CHANNELED - A powerful slowing and damaging current that grows stronger as it\'s channeled. Lasts up to 10 / 12 / 14 / 16 seconds. Enemies are slowed for 3 seconds after leaving the area or the spell ends.','The slow increase is based on length of the channel, not the duration an enemy was standing in the area.','Demnok manipulates space-time, impairing entire armies.','https://www.dotabuff.com/assets/skills/warlock-upheaval-5164-d8377cfe33285f526ebab101b00534163e92304d93c15f62a61ead44038f529f.jpg'),
(39,7,'Eldritch Summoning','Whenever an enemy unit dies while afflicted by one or more of Warlock\'s abilities, a minor imp is summoned that lasts for 15 seconds and explodes on death. Imps will automatically seek out nearby units, favoring fatally bonded heroes, and will explode when reaching their prey.','Minor imps have 50 / 130 / 210 / 290 / 370 health and explode for 25 / 70 / 115 / 160 / 205 damage in a 400 radius.',NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(40,7,'Chaotic Offering','Summons a Golem from the depths, stunning enemies for 0.8 seconds. The Golem lives 60 / 60 / 60 seconds, takes reduced damage from spells, has increased Slow Resistance, has Permanent Immolation and Flaming Fists on attack.','This ability destroys trees in its area of effect.','Demnok unleashes the captive spirit in his Dreadwood staff, causing destruction in enemy ranks.','https://www.dotabuff.com/assets/skills/warlock-chaotic-offering-5165-70156d3b519df30db74efabf88a4b8ed0369551bf39daabcb00301f2c65c2642.jpg'),
(41,8,'Mist Coil','Abaddon releases a coil of deathly mist that can damage an enemy unit or heal a friendly unit at the cost of some of Abaddon\'s health.','Abaddon can not kill himself with this skill.','A mysterious vapor from the Font of Avernus now infuses the breath of Abaddon, who releases it at will.','https://www.dotabuff.com/assets/skills/abaddon-mist-coil-5585-021014b70289ff20e3132312e0e3b024d7b13d5036d20c9d6f0615cb821d102f.jpg'),
(42,8,'Aphotic Shield','Summons dark energies around an ally unit, creating an all damage barrier that absorbs a set amount of damage before expiring. When the barrier is destroyed it will burst and deal damage equal to the amount it could absorb to an area around it. Removes certain types of negative buffs and stuns on cast.DISPEL TYPE: Strong Dispel','The max damage is always dealt whether the barrier is destroyed by expiring or absorbing damage.The explosion does not damage units hidden by the fog of war.','The powers of the black mist rise to absorb attacks like the black mist absorbs light.','https://www.dotabuff.com/assets/skills/abaddon-aphotic-shield-5586-b8818dc60bdc11bc03b32dbb16b0cf13203a383d002de414f674bba8d6a9e096.jpg'),
(43,8,'Curse of Avernus','Abaddon strikes an enemy, affecting them by a chilling curse, slowing them, causing them to take damage over time, and all attacks against them gain an attack speed boost. Damage over time component to buildings is reduced by 70%.',NULL,'While the baptized draw strength from the Font, the gifts of Avernus are debilitating to the uninitiated.','https://www.dotabuff.com/assets/skills/abaddon-curse-of-avernus-5587-4f6afaf1ed76efe6771e0b0700e9e90b3aaadce80de6d810b06d82ee68fcd3ea.jpg'),
(44,8,'Withering Mist','Damaging enemies applies the Withering Mist debuff for 5s. Affected enemies have their HP regeneration, healing, lifesteal and spell lifesteal reduced by 35% if they are below 40% HP.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(45,8,'Borrowed Time','When activated, all damage dealt to you will heal instead of harm. Most negative buffs will also be removed. If the ability is not on cooldown, it will automatically activate if your health falls below 400.DISPEL TYPE: Strong Dispel','Borrowed Time can be manually activated while Abaddon is disabled, but not while silenced.  The passive activation can still occur while silenced.Aphotic Shield does not block any damage to Abaddon when Borrowed Time is active, allowing him to heal.Break prevents Borrowed Time from automatically activating.','The most unnatural of all the gifts of the Font of Avernus, this power defies mortal understanding.  What should hurt, instead heals; and what should kill gives strength anew.','https://www.dotabuff.com/assets/skills/abaddon-borrowed-time-5588-1e22182729478cc7813ac210ba7827331c61b28ab9c88c2ff186da24cedcf83e.jpg'),
(46,9,'Vacuum','Dark Seer creates a vacuum over the target area that sucks in enemy units, disrupting them and dealing damage.','This ability interrupts channeling.Pulls units over 0.3 / 0.4 / 0.5 / 0.6 seconds before dealing damage.Trees near the center of the vacuum will be destroyed.','Ish\'Kafel modifies the center of gravity to a place of his choosing.','https://www.dotabuff.com/assets/skills/dark-seer-vacuum-5255-963b7c4799390bc019bb6ba1b0cedbb368a30627d7907786e79be9f2b4973d72.jpg'),
(47,9,'Ion Shell','Surrounds the target unit with a bristling shield that damages enemy units in an area around it.','Deals small amounts of damage in 0.2 second intervals.Doesn\'t damage the target it is cast on.If cast on a unit that already has Ion Shell, the new Shell replaces the old one.','The Dark Seer slices holes into the \'Land Behind the Wall,\' causing prismatic energy to seep forth.','https://www.dotabuff.com/assets/skills/dark-seer-ion-shell-5256-be965f9b70751788688b9b3addb97efaeca695bdaee663ad64e38095ee213d64.jpg'),
(48,9,'Surge','Charges a target friendly unit with power, giving it a brief burst of phased movement speed. Allows the unit to reach maximum movement speed and cannot be slowed.','Units with Surge cannot be slowed unless the Surge effect is removed.','Ish\'Kafel once used his speed of mind to navigate the maze between the walls.','https://www.dotabuff.com/assets/skills/dark-seer-surge-5257-4fc63886a6657cddcf0b375b5a8bfb62949631a2d9dd46738833c9862e6b7de0.jpg'),
(49,9,'Normal Punch','Passive ability. Causes Dark Seer\'s next attack on a hero to have True Strike, knock a replica out of the victim, damaging and stunning them based on how far Dark Seer has moved in the past 3 seconds. Max power is reached after 1100 distance moved.',NULL,NULL,'https://www.dotabuff.com/assets/skills/dark-seer-normal-punch-687-7bb3771f41fad0238465b574a95610a503906c2d280bb5b7fb48ee81311c0d69.jpg'),
(50,9,'Mental Fortitude','Dark Seer\'s Intelligence cannot be lower than the average of his Strength and Agility.','If the average between his Strength and Agility is higher, he gains Bonus Intelligence to match them.',NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(51,9,'Wall of Replica','Raises a wall of warping light that slows, damages, and creates replicas of any enemy hero who crosses it. Enemy replicas serve at the Dark Seer\'s will. Replicas last until they are destroyed, or until the wall\'s duration ends.','Doesn\'t create illusions from other illusions.There cannot be more than one illusion per player per wall.Wall of Replica will not slow spell-immune enemies.','The Dark Seer, while unable to return to his natural realm, can channel part of the prismatic wall with powerful strength of mind, sowing confusion amongst enemy ranks.','https://www.dotabuff.com/assets/skills/dark-seer-wall-of-replica-5258-b87722f5cffb7655cddb603ef8a487bb33176a2915c7af987362760b32c147ee.jpg'),
(52,10,'Spirit Lance','Sends a magical spirit lance to a target enemy unit that damages and slows, while summoning an illusory phantom to attack the unit.','Nearby illusions will mimic the cast animation.','Azwraith\'s proficiency at spearing his family\'s meal of fish is proving quite useful in the battlefield.','https://www.dotabuff.com/assets/skills/phantom-lancer-spirit-lance-5065-a262aacce4c342a0486fe439e9b5ed585fa0201d7b27d82bb81a137c7ea34917.jpg'),
(53,10,'Doppelganger','Phantom Lancer briefly vanishes from the battlefield. After 1 second, Phantom Lancer and any of his nearby illusions reappear at a random position within the targeted location, along with two additional doppelgangers. Extends duration of all illusions. The two added doppelgangers have different properties: one takes normal damage and deals none, while the other takes 500% bonus damage and deals -80% less damage.DISPEL TYPE: Basic Dispel','This ability can be used to dodge projectiles, and dispel debuffs.Trees near a reappearing unit will be destroyed.Phantom Lancer and his allies can see which illusion is the 100% damage illusion.','Dread Magus Vorn\'s death imbued the Phantom Lancer with the ability to bend and fracture all spectrums of light.','https://www.dotabuff.com/assets/skills/phantom-lancer-doppelganger-5066-81fa4cd043be49f97037e45095bcbe2016a855e4d0a3a4b0cb7014055d2a8c41.jpg'),
