(160,29,'Fervor','With each continuous blow on the same target, Troll gains increased attack speed.  If Troll changes targets, the stacks drop to zero.','Break disables the gaining of new stacks.Break disables the proc chance granted by Aghanim\'s Shard.','If at first you don\'t succeed, strike, strike again.','https://www.dotabuff.com/assets/skills/troll-warlord-fervor-5511-d44b98cc3e55826498a70a9f2f65ef94aa6d2ec39755b5857902603b06468d5d.jpg'),
(161,29,'Berserker\'s Rage','While in melee form, Troll Warlord\'s attacks have a chance to ensnare, preventing the target from moving or using mobility spells and has additional movement speed and armor.When in ranged form, Troll Warlord\'s attacks have a chance to Maim the target, dealing bonus damage, and slowing the target\'s movement and attack speed.','Cooldowns of items that are different for ranged and melee units will be based on which form Troll Warlord was in when the item was used.','Like his anger, Troll Warlord\'s supply of axes is infinite.','https://www.dotabuff.com/assets/skills/troll-warlord-berserkers-rage-5508-9a761b13254524a54d85fab146791459c38419a80a3b0fbb785d66a77780619c.jpg'),
(162,29,'Battle Trance','Troll unleashes a powerful battle trance, that forces you to continuously attack the closest enemy unit within 900 range, prioritizing heroes. Damage does not kill you during this mode. Grants you bonus lifesteal, attack speed and movement speed. Applies a Basic Dispel.DISPEL TYPE: Basic Dispel','Troll can still use his items and abilities while affected by Battle Trance, but not other commands.Troll can still be killed with Axe\'s Culling Blade.Troll is granted vision over the target.','An adrenaline rush of pure hatred quickens your blades.','https://www.dotabuff.com/assets/skills/troll-warlord-battle-trance-5512-9b0669d74128812dcfffc4cb381bcacdc75ef3f0b005527fd8b4834ef33c47ed.jpg'),
(163,30,'Battery Assault','Discharges high-powered shrapnel at random nearby enemy units, dealing minor magical damage and ministun. Deals double damage to creeps.','Remains active if Clockwerk is disabled.','Some of Rattletrap\'s contraptions don\'t quite work correctly, so detonating them proves useful as an offensive maneuver.','https://www.dotabuff.com/assets/skills/clockwerk-battery-assault-5237-1b5a9cd64fd064e25aa3bb57fde5bc0745e8bb00ee1154de3e518d22155f95b7.jpg'),
(164,30,'Power Cogs','Forms a ring of energized cogs around Clockwerk, trapping any units that are near. Enemies outside the trap that touch a cog are knocked back, losing health and mana. Once a cog has delivered a shock, it will power down. Damage is increased by 50% of the mana burned. Cogs can be destroyed by enemy attacks, but Clockwerk can push them up to 1000 distance away with one hit.','Cogs can shock invisible units.','One of Clockwerk\'s inventions of which he is most proud is the power cog - though it is sometimes despised by his allies.','https://www.dotabuff.com/assets/skills/clockwerk-power-cogs-5238-df28499718f22723f6d9eb1b57d8bd57a21975b698682eb9fca5629041f4db82.jpg'),
(165,30,'Rocket Flare','Fires a global range flare that explodes over a given area. Upon impact, enemies in the area take damage and are briefly slowed. Rocket flare provides vision over the impact area for 6 seconds.',NULL,'What started as a festive display has become a useful scouting and bombardment tool.','https://www.dotabuff.com/assets/skills/clockwerk-rocket-flare-5239-43db2ff51e68504e2b853699e56caf40a9eb5916084e36c1b6e3fc1a58887044.jpg'),
(166,30,'Overclocking','Supercharges Clockwerks abilities: Battery Assault affects all enemies in its range; Clockwerk\'s attack speed in Power Cogs is increased; Rocket Flares have a reduced cooldown and fire additional rockets to either side of the target; Hookshot stun radius and duration is increased; Jetpack moves faster. Clockwerk\'s movement and attack speed becomes slowed to a crawl after the duration runs out.',NULL,'Rattletrap understands the limitations of his armor. Just as he understands the risks of pushing past them in times of need.','https://www.dotabuff.com/assets/skills/clockwerk-overclocking-321-5f26285deb6597afd45ab5973294db2d73a296b1537b10e98ffe04ece0403bbf.jpg'),
(167,30,'Jetpack','Clockwerk activates a jetpack, gaining flying movement, flying vision, and bonus movement speed. Clockwerk has a severely-limited turn rate during this time and cannot attack. Jetpack is cancelled upon casting Hookshot.',NULL,NULL,'https://www.dotabuff.com/assets/skills/clockwerk-jetpack-630-19a5123fc73b73100fd2353a8154baf2d0ca0bc06ff2ab05a0a16c75d84bd5f1.jpg'),
(168,30,'Hookshot','Fires a grappling device rapidly at the target location.  If the hook hits a unit, Clockwerk launches himself into the target, stunning and dealing damage to everyone in a 175 radius around the hit target.  Any enemies Clockwerk collides with along the way are damaged and stunned.','Hookshot will latch and take Clockwerk to allies, but not damage or disable them.','A somewhat unwieldy device, the Hookshot sends the otherwise clunky Clockwerk armor flying through the air.','https://www.dotabuff.com/assets/skills/clockwerk-hookshot-5240-d0face44c020a95a8ba69611bc40f68746a4be175ce85524e1be675e6ff0aee7.jpg'),
