(170,31,'The Swarm','Weaver launches a swarm of 12 / 12 / 12 / 12 young Weavers that latch on any enemy unit in their path, attacking and reducing armor until it is killed.','When a beetle latches on a target, it will remain there until it is killed or the duration expires.Beetles are Spell Immune, but can be killed in 6 / 6 / 8 / 8 attacks from a unit. Heroes deal double damage to beetles.Beetles provide vision.','Skitskurr opens a gap in the space time fabric, allowing young Weavers to slip through and aid him in combat.','https://www.dotabuff.com/assets/skills/weaver-the-swarm-5289-13bf89047a1eb29def27338bf4190fb4d87b65965048d0fbe64b5728114b1251.jpg'),
