(173,31,'Time Lapse','Weaver warps backward to whatever position it was in five seconds earlier-regaining the HP and mana from that time. No effect on cooldown, gold or experience.DISPEL TYPE: Strong Dispel','Removes most negative buffs from Weaver.Time Lapse disjoints projectiles.','If Skitskurr does not deem the current reality of the world to fit his desires, he simply crawls back in time to right what was wronged.','https://www.dotabuff.com/assets/skills/weaver-time-lapse-5292-cd2af99e7d671b26b7e7c1cc19eeae40ede75de0fe1eaca442df9fa8f8769d32.jpg'),
