(177,32,'Thirst','Bloodseeker is invigorated by the wounds of his enemies, gaining bonus movement speed when an enemy hero\'s health falls below 100%, with the bonuses increasing as their health falls further. If an enemy hero\'s health falls below 25%, he will also gain vision and True Sight of that hero. Bonuses stack per hero. Unlocks max movement speed for Bloodseeker.','Not triggered by Illusions.Max movement speed bonus occurs when an enemy\'s health is at or below 25%.Effects linger for 4 seconds if a target dies.','Strygwyr becomes frenzied when blood is spilled.','https://www.dotabuff.com/assets/skills/bloodseeker-thirst-5017-9787fc3fe027b3eb90d6f749b0c72ca3c613106856f7b9608b8208cf0dd7bc45.jpg'),
