(191,34,'Nether Swap','Instantaneously swaps positions with a target Hero, friend or enemy. Nether Swap interrupts channeling abilities on the target. Enemy Swapped units take damage. Vengeful Spirit and allied swapped units gain a barrier equal to the damage dealt.','Works on Spell Immune units.Trees near Vengeful Spirit and the target will be destroyed when the spell is cast.Channeling spells are interrupted by Nether Swap.','Martyrdom is a small price to pay for vengeance.','https://www.dotabuff.com/assets/skills/vengeful-spirit-nether-swap-5125-88be583ef6e55737efa149d439f3bce0c329febe0a1af49c58effe701b944be3.jpg'),
(192,35,'Insatiable Hunger','A violent lust for vital fluids increases Broodmother\'s attack damage and gives her a vampiric attack. Lifesteal from creeps is reduced by 40%.','Fully stacks with other sources of lifesteal.','While most of her prey is wrapped in silken cocoons and saved for her young, the Broodmother herself has a taste for wandering heroes.','https://www.dotabuff.com/assets/skills/broodmother-insatiable-hunger-5282-4c7ab22f6b1668b5a24c75b244bf2b3e7f4fbedea1fdaedf9dcc56b2dc42c3b1.jpg'),
(193,35,'Spin Web','Spins a large web that grants Broodmother a passive movement speed increase and increases her Turn Rate, while in its vicinity, as well as giving free movement. Spin Web charges restore every 27 seconds, with a max of 4 / 6 / 8 / 10 charges.Spin Web can be cast from anywhere as long as the new web touches an existing web. Webs never expire, and can be manually destroyed. When the maximum limit of webs is exceeded, the oldest web disappears.','Also affects Spiderlings.Grants full movement speed bonus at 100% HP, 0% movement speed bonus at 1HP','Weaving a bed of silken fibers, Arachnia\'s web both protects her and her offspring, as well as giving advancing opponents a sense of foreboding.','https://www.dotabuff.com/assets/skills/broodmother-spin-web-5280-2ee712a82b8fa835a57ecc179348ba6e13366ae479ef9cd71ec4e1f404aa0005.jpg'),
