(195,35,'Spinner\'s Snare','Broodmother may create up to 5 invisible web lines touching any existing web. Enemy Heroes that cross the web line will spring the trap, becoming rooted, revealed in fog, and take damage over time.  Multiple Heroes can trip on the same line until it\'s destroyed after being initially triggered.  Broodmother\'s team is alerted via the minimap when an enemy has triggered the snare.',NULL,'The slightest tremor of her web is all Arachnia needs to find her prey.','https://www.dotabuff.com/assets/skills/broodmother-spinners-snare-873-5992f885da2525e1b2ce3ca382cc130d8d23c43fa6e6060f7099ccfb88247598.jpg'),
