(197,35,'Spawn Spiderlings','Broodmother injects her young into an enemy unit, dealing damage and slowing them for 4 seconds. The spiderlings will hatch if the target is killed while under this influence.','If the target is killed within 20 seconds of being hit with this skill, the Spiderlings will spawn.Units killed by Spiderlings will then give birth to additional Spiderlings.','Black Arachnia continues to raise her young, even amidst the field of combat.  The brood quickly learns how to support their mother.','https://www.dotabuff.com/assets/skills/broodmother-spawn-spiderlings-5279-982dee0405b97eb5b38f1dce564a7911184e265fa5d2e147fddea7fc2656ce49.jpg'),
(198,36,'Shackleshot','Shackles the target to an enemy unit or tree in a line directly behind it.  If no unit or tree is present, the stun duration is reduced to 0.6.','This spell can shackle two enemies together, stunning them both.Can shackle the target to an enemy unit or tree at most 575 behind the target.Shackleshot can be disjointed.','Windranger\'s variety of bow skills includes an arrow with thick ropes attached to encumber any escaping target.','https://www.dotabuff.com/assets/skills/windranger-shackleshot-5130-fef881c8cdcf144986a87c12b288c72351755924862881460595cd88e1771978.jpg'),
