(207,37,'Feast','Lifestealer\'s attacks deal damage and provide heal for a percentage of his target\'s max health. Allows Lifestealer to attack allied creeps at 75% health. Lifestealer gains permanent max HP whenever he kill a creep or hero.','Works on allies and enemies. Does not affect Roshan.The heal is independent of the damage.Stacks additively with other sources of Lifesteal.Break disables the gaining of new stacks.Break does not disable the bonuses from existing stacks.','After escaping from his cell in Devarque, N\'aix subsisted on flesh and bones of those unfortunate to cross his path.','https://www.dotabuff.com/assets/skills/lifestealer-feast-5250-9ab98e66e025fd06dae53150aa9f82a0f2b54ea2dab4f4ee0a2867c9f821531b.jpg'),
(208,37,'Infest','Lifestealer infests the body of a target unit, becoming undetectable, and healing for a portion of his max hitpoints every second while inside. He can then explode from the host body, dealing damage to nearby enemies. If the infested unit is an enemy creep or a neutral creep, he can take control of the unit\'s ability to move and attack. Does not work on enemy heroes.DISPEL TYPE: Basic Dispel','Lifestealer gains experience while under the effects of Infest.Creeps that are controlled while Infested gain Infest\'s movement speed bonus.Infest Level 2 and 3 can be used on Ancient creeps.Does not trigger spell reflect.','With this infestation, N\'aix consumes the life blood of the host, restoring him back to full unholy power.','https://www.dotabuff.com/assets/skills/lifestealer-infest-5252-ae3785ee436002099e2458c97c0914f93a525d89261bf7bd8545055161262585.jpg'),
(209,37,'Consume','Lifestealer eats the host body from the inside out, exploding from within.',NULL,NULL,'https://www.dotabuff.com/assets/skills/lifestealer-consume-5253-e2df62419eadc6e5d21f2c4832095250af979527032d2f225b0a782654a83fa9.jpg'),
(210,38,'Arcane Bolt','Skywrath Mage launches a slow-moving bolt of arcane magic, dealing damage to an enemy unit based on Skywrath Mage\'s intelligence.','The projectile moves very slowly (500 ms), providing 325 vision around it.  Upon impact, it will reveal the target area for 3.34 seconds.Arcane Bolt cannot be disjointed.','Within the Ghastly Eyrie\'s endless intrigue, only the clever and calm can hope to survive.','https://www.dotabuff.com/assets/skills/skywrath-mage-arcane-bolt-5581-633c88a65ceebdfcd4993d14ef26c5b523463ff8cbc47cba10a05614291fc113.jpg'),
(211,38,'Concussive Shot','Skywrath Mage sets off a long range shot that hits the closest hero within a long range.  Upon impact, it deals damage and slows in an area of effect. Deals 75% damage to creeps.','If no enemy heroes are in range or they are in fog, Concussive Shot targets the nearest enemy creep.Damages creeps around the impact area.Provides 400 vision around the projectile, and reveals the target area for 3.34 seconds upon impact.','Those who serve the court of the Ghastly Eyrie are ever locked in covert war. One must always know where danger lurks nearest.','https://www.dotabuff.com/assets/skills/skywrath-mage-concussive-shot-5582-b5679548693ec4deabc479484b0d70cba4d4b5d88d4d44db1aa00d2af8cf1851.jpg'),
(212,38,'Staff of the Scion','Every time Skywrath Mage deals magic damage to an enemy hero with an ability, he reduces all his ability cooldowns by 0.1s.',NULL,NULL,'https://www.dotabuff.com/assets/skills/skywrath-mage-staff-of-the-scion-1387-3367d87546d51708db1e8265b4e6d71ffd5bfbf47508564c27e25ca54076a17a.jpg'),
(213,38,'Shield of the Scion','Every time Skywrath Mage deals magic damage to an enemy hero with an ability, he gains a magic damage barrier equal to 10 + 1 per his hero level. Each buff stacks independently.',NULL,NULL,'https://www.dotabuff.com/assets/skills/skywrath-mage-shield-of-the-scion-833-298e0ba8654ff65a462f77bebdc7a55c09eeabef9cdaef13c40baef5c60ead3e.jpg'),
(214,38,'Ancient Seal','Skywrath Mage seals the targeted unit with an ancient rune, silencing it and causing it to take additional damage from spells.','The magic damage resistance reduction doesn\'t affect creeps.','A holy incantation, whosoever finds themselves touched by Avilliva\'s sigil must suffer in penitent silence.','https://www.dotabuff.com/assets/skills/skywrath-mage-ancient-seal-5583-b24d54b22abbf989477d820040127a7eb355f97a366b3bc4be61a69b314f5966.jpg'),
(215,38,'Ruin and Restoration','Skywrath Mage has 20 / 30 / 40 / 50% Spell Lifesteal.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(216,38,'Mystic Flare','Skywrath Mage uses his ultimate magical ability to conjure a precise and violent mystical field that lays waste to his adversaries. Deals massive damage distributed evenly among any Heroes in the area over 2 seconds.','Mystic Flare only affects Heroes; it does not damage illusions or creep heroes.Spell immune enemies do not count toward the damage distribution.Mystic Flare will damage enemy creeps if no enemy heroes are present.','Only the most practiced of Skywrath sorcerers could hope to shape the skies into such a storm.','https://www.dotabuff.com/assets/skills/skywrath-mage-mystic-flare-5584-5179a94ad04c8165e2c20291571ae164822059383192c5f3ca5199688053e037.jpg'),
(217,39,'Rawhide','Permanently gain 30 max health every 120s.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(218,40,'Grave Chill','Visage drains the movement and attack speed of the targeted unit, gaining it for itself and nearby familiars.','The two buffs can be removed separately by dispels.The speed gained is independent of the speed lost on the target.Familiars within 900 range of Visage will also receive bonuses from Grave Chill.','The warmth of the sun is never felt in the dark cold of the Narrow Maze.','https://www.dotabuff.com/assets/skills/visage-grave-chill-5480-844a832045d4b9ec2e68b63a18735c041b00fe6012aaa205a167373086ae7651.jpg'),
(219,40,'Soul Assumption','Visage gathers charges of soul essence each time nearby heroes take more than 100 damage. When the essence is released, it deals base damage as well as damage for each gathered soul charge.','Charges are only gained for damage greater than 2 and less than 3000 that is dealt by a player or Roshan.  Self-damage or Soul Assumption damage isn\'t counted.','The collected souls of the dead reach out to bring another into their fold.','https://www.dotabuff.com/assets/skills/visage-soul-assumption-5481-29f243cfa83287fa1d0a72ff347b607eb9214de5cadce3628e0bfb38abaf37bd.jpg'),
(220,40,'Gravekeeper\'s Cloak','Visage generates a layered barrier that protects him from damage.  If he receives damage from a player, one layer is removed, and takes time to recover.','Each time Visage receives damage greater than the Minimum Damage that was not self-inflicted and was from a player owned source, a layer is removed.Familiars within 900 range of Visage will receive the current damage reduction from Gravekeeper\'s Cloak.Break disables the gaining of new stacks.Break does not disable the bonuses from existing stacks.','Visage\'s tough scales share equal properties of ghost and stone, making it nearly impervious to blade and magical assault.','https://www.dotabuff.com/assets/skills/visage-gravekeepers-cloak-5482-03d965f01a62281c64c4a0ff7cb96452418adaee16254b36ae546fe05e606e3d.jpg'),
(221,40,'Stone Form','Orders the Familiar closest to Visage to cast Stone Form in its current location, turning into stone and smashing into the ground, stunning and damaging all targets in the area.  The Familiar becomes invulnerable, and will regain its health very rapidly.  After 6 seconds, the Familiar will automatically leave Stone Form. Can be alt-cast to order the closest Familiar to the target location to move there and cast Stone Form.','While Stone Form is not dispellable, the stun can be removed by strong dispels.',NULL,'https://www.dotabuff.com/assets/skills/visage-stone-form-7116-5fafc0b2186a6a0402f713b9258132f62c14125b36099107c42f94f5c68f4f73.jpg'),
(222,40,'Silent as the Grave','Turns Visage and familiars invisible, granting Visage bonus movement speed and upgrading its movement type to flying. When Visage or its familiars leave invisibility they deal more damage for a short duration. Lasts 30 seconds. Invisibility ends when attacking or casting.',NULL,NULL,'https://www.dotabuff.com/assets/skills/visage-silent-as-the-grave-683-40b313b4e6446c1a4278f62819f8656db99aebaf1d01d94b2691d15a5e8e8dfd.jpg'),
(223,40,'Summon Familiars','Conjures 2 blind Familiars to fight for Visage.  Familiars possess the Stone Form ability, that allows them to turn into stone, stunning enemies upon landing.  While in Stone Form, Familiars are invulnerable, and rapidly regenerate their health.  Familiars grant high bounty when killed.','Casting Summon Familiars will replace any existing Familiars.Familiars within range of Visage will receive bonuses from Gravekeeper\'s Cloak and Grave Chill.','Guardians of the Narrow Maze, Necro\'lic\'s Familiars stand watch over his domain.','https://www.dotabuff.com/assets/skills/visage-summon-familiars-5483-a0dd564c06aa5506d1edd0164510d14c22f40698022bc860c6cbb03988f57f6d.jpg'),
(224,40,'Stone Form','After a short delay, the Familiar turns into stone and smashes into the ground, stunning and damaging all targets in the area.  The Familiar becomes invulnerable, and will regain its health very rapidly.  After 6 seconds, the Familiar will automatically leave Stone Form.  Can be alt-cast to order the Familiar to move to the target location and cast Stone Form.',NULL,NULL,'https://www.dotabuff.com/assets/skills/visage-stone-form-5484-5fafc0b2186a6a0402f713b9258132f62c14125b36099107c42f94f5c68f4f73.jpg'),
(225,40,'Lurker','Visage\'s ability cooldown durations are reduced as long as he\'s not taking damage.Grants a stack every 2s that Visage does not take damage. Each stack grants 2% cooldown reduction with a max of 10 stacks. Stacks fade after 2s upon taking any damage.','Break disables the gaining of new stacks.Break does not disable the bonuses from existing stacks.Affects Visage\'s ability cooldown durations, including spells already on cooldown.',NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(226,41,'Strafe','Clinkz gains attack speed and has bonus attack range. Any current Skeleton Archers within a 1200 radius of Clinkz also gain bonus attack range and 60% of the attack speed bonus.  Casting Strafe does not break Skeleton Walk invisibility.',NULL,NULL,'https://www.dotabuff.com/assets/skills/clinkz-strafe-1120-64ff8ab80683264bef1fce8d896f5e2252dd514a642a98d5a82cd7d4c9ac0570.jpg'),
(227,41,'Tar Bomb','Clinkz throws a projectile filled with tar at the target enemy, dealing Magic damage on impact. After impact, the tar spills onto the ground and stays there for 5 seconds. Any enemy that walks across it gets slowed, and attacks from Clinkz or his Skeleton Archers will deal bonus physical damage. When the Tar Bomb hits, any Skeleton Archers within attack range will attack the target.',NULL,NULL,'https://www.dotabuff.com/assets/skills/clinkz-tar-bomb-1119-8740786ac4eed659bfed79a3a49203ed172e017f9edf3ad70d2f9da6dd4a185d.jpg'),
(228,41,'Death Pact','Clinkz consumes the target enemy creep or friendly Skeleton Archer and creates a Skeleton Archer in their place, healing and gaining max health. Does not take Clinkz out of Skeleton Walk. Only one archer can be summoned from Death Pact at a time.','If the target is an enemy, Clinkz will gain the correct experience and gold.Increases Clinkz\' current and max HP.When the duration ends, max HP returns to normal, but current HP stays the same.','Sutherex\' bond of life and death has become a part of Clinkz, and his old bones are refreshed with repetition of the pact on lesser beings.','https://www.dotabuff.com/assets/skills/clinkz-death-pact-5262-8f5a862e02ac3347a59975ac3b593c170c24a3dedbfc80983159826182cd12de.jpg'),
(229,41,'Burning Barrage','CHANNELED - Clinkz channels and shoots multiple piercing arrows in the target direction that hit all enemy units dealing a percentage of Clinkz\' attack damage and applying attack modifiers, and dousing enemies with Tar Bomb slow.','Bonus Attack Range increases the length of Burning Barrage.','It\'s hard to say whether the blur around the Bone Fletcher is from his flaming heart or his speed with the quiver.','https://www.dotabuff.com/assets/skills/clinkz-burning-barrage-5259-bc82c8ded2b6ec6d5a929893664607c7a1c9f40e7a6b7901b5a4b58ae6a439b0.jpg'),
(230,41,'Burning Army','Summons a row of Burning Skeleton Archers in the target location.',NULL,'Existing on the brink of life and death, Clinkz has learned to temporarily bridge the gap between the two.','https://www.dotabuff.com/assets/skills/clinkz-burning-army-7319-25256988916234bda79804bbdc0902d5b3585c8e4fc54f47daf460f907fb6377.jpg'),
(231,41,'Skeleton Walk','Clinkz moves invisibly through units until the moment he attacks or uses items. Leaving Skeleton Walk creates Skeleton Archers.','Has a fadetime of 0.6 / 0.6 / 0.6 seconds.','With a burst of fire and puff of smoke, the Bone Fletcher was nowhere to be seen.','https://www.dotabuff.com/assets/skills/clinkz-skeleton-walk-5261-83c140b4bb6bc58bf0020741c1a5a51ab90e3614a38c5141a7d89e9d67f15174.jpg'),
(232,41,'Bone and Arrow','Clinkz summons a Skeleton Archer when he dies. Skeleton Archers are immobile and die within multiple attacks from a hero. Skeleton Archers deal a percentage of Clinkz\' damage, and deal less damage to buildings. Attack range is equal to Clinkz\' attack range.Some of Clinkz\' other abilities can also summon Skeleton Archers.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(233,42,'Impale','Rock spikes burst from the earth along a straight path. Enemy units take damage, then are hurled into the air and stunned.','The spikes move at 1600 units per second, over 750 range.Impale cannot be blocked by Linken\'s Sphere.','All zealot scarabs possess intimate knowledge of underground pathways, using them to their advantage.','https://www.dotabuff.com/assets/skills/nyx-assassin-impale-5462-4d354dbb72f72e756de26935686fa2051f542283768ca0fcb123d9a604265eca.jpg'),
(234,42,'Mind Flare','Deals damages to the enemy equal to a percentage of its Max Mana. Additionally deals damage equal to a percentage of damage the target received from Nyx Assassin in the past 15s. Instantly kills non-ancient creeps.',NULL,NULL,'https://www.dotabuff.com/assets/skills/nyx-assassin-mind-flare-1104-4b5970243668ed5f7d04591b83a4a5bb6fd4b9a434b7c83c5eafde9b845b5cfa.jpg'),
(235,42,'Spiked Carapace','When activated while above ground, Spiked Carapace reflects and negates damage dealt to Nyx Assassin (max once from each source), as well as stunning the source of the damage. Activating Spiked Carapace will not break Vendetta invisibility.While Burrowed, Spiked Carapace instantly stuns nearby enemies when cast.','The damage is calculated after all reductions.Spiked Carapace will only trigger on damage from other player controlled units.The damage reflected will have the same damage type as it had when it was dealt to Nyx.','While their carapace is relatively thin, it\'s guarded by a retractable field of razor-sharp spikes.','https://www.dotabuff.com/assets/skills/nyx-assassin-spiked-carapace-5464-888f8d4f73b9942a2a192ba9a8202b11718c4a2fad942fa2067bfc1ba5ee8756.jpg'),
(236,42,'Burrow','Nyx Assassin buries himself beneath the battlefield over a short duration. Once burrowed, Spiked Carapace instantly stuns nearby enemies when cast, the range of Mind Flare and Impale is increased, and Impale\'s cooldown is decreased. While burrowed, Nyx Assassin is stationary, unable to attack, and invisible. Nyx gains damage reduction from all damage sources.','Casting Vendetta will cancel burrow.','Some castes of zealot scarab are known to create small burrows to lie in wait, ready to ambush their prey.','https://www.dotabuff.com/assets/skills/nyx-assassin-burrow-5666-a01a3836084f83b8133ffa27856d427505a5040ddad231af30895fe2e2e34f46.jpg'),
(237,42,'Nyxth Sense','Nyx Assassin can detect heroes within 350 units of himself.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(238,42,'Vendetta','Allows Nyx Assassin to become invisible and gain a speed bonus.  If Nyx Assassin attacks to break the invisibility, massive bonus damage is dealt with the attack. Nyx Assassin has 75 additional attack range and a 70% faster attack animation for this attack.','Has a 0 second fadetime.If a spell is used to break the invisibility, or the invisibility expires, the bonus damage is lost.With Aghanim\'s Shard, the Break is applied before the bonus damage.','The scarab kills for the glory of his queen.','https://www.dotabuff.com/assets/skills/nyx-assassin-vendetta-5465-ed056c7db7bc0730003b1e5bf33fd21fae6256350f38685a00d091e120cbf23f.jpg'),
(239,42,'Unburrow','Emerge from the burrow.',NULL,'Some castes of zealot scarab are known to create small burrows to lie in wait, ready to ambush their prey.','https://www.dotabuff.com/assets/skills/nyx-assassin-unburrow-5673-46afc7aaa4e84475f25f2ca385c4876a21ef04fcc1984bba47f2ad7f9c79da27.jpg'),
(240,43,'Shuriken Toss','Hurls a deadly shuriken at an enemy unit, dealing damage and slowing the target\'s Movement Speed by 100% for 0.35s.  The shuriken will bounce to any Tracked units who are within a 1200 radius of each other.',NULL,'While the shuriken may be small, Gondar\'s precise aim can cause critical damage.','https://www.dotabuff.com/assets/skills/bounty-hunter-shuriken-toss-1314-822e882121f54683667e0dfca237843332c5f9191682b2c87feaf7c045a7e404.jpg'),
(241,43,'Jinada','Bounty Hunter plans his next hit, dealing bonus damage and stealing some unreliable gold.',NULL,'Gondar\'s vast experience ensures he never walks away from a transaction empty-handed.','https://www.dotabuff.com/assets/skills/bounty-hunter-jinada-5286-b8fcc207c585debbe911f71e730f01745e8d7d5bc80c62f7384080ae69a6c35c.jpg'),
(242,43,'Shadow Walk','Bounty Hunter becomes invisible and gains the ability to move through other units until he attacks or uses an ability.  If he breaks the invisibility with an attack, that attack will stun the target for a short duration.','Will not break most channeling of spells upon activation.','The court jesters present during King Goff\'s assassination can recount no other image than a dancing shadow.','https://www.dotabuff.com/assets/skills/bounty-hunter-shadow-walk-5287-6161493ee54e40a015df50fba3c5385d49fa40fd7552931f16c20a9b353a4683.jpg'),
(243,43,'Friendly Shadow','Applies Shadow Walk and all of its bonuses to the target ally. Allied fade time is 1s. Does not break Bounty Hunter\'s invisibility when cast.',NULL,NULL,'https://www.dotabuff.com/assets/skills/bounty-hunter-friendly-shadow-1136-6161493ee54e40a015df50fba3c5385d49fa40fd7552931f16c20a9b353a4683.jpg'),
(244,43,'Big Game Hunter','When getting a kill or assist on an enemy that has a killing streak, Bounty Hunter receives 20% extra gold.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(245,43,'Track','Tracks an enemy hero, granting True Sight of the target, increasing the damage they take and providing information on how much gold it is carrying. Bounty Hunter moves fast when near the tracked unit. If the target dies, Bounty Hunter and nearby heroes collect a bonus bounty of gold. Casting Track does not take you out of invisibility.','Bounty Hunter will get the bonus gold if the target dies while Track is active, regardless of how it died.Track\'s effect is only visible to allies.You can see the amount of gold the target is carrying by mousing over the debuff icon above the target\'s ability bar.Bonus gold is reliable gold.Reapplying Track does not steal gold with Cutpurse.','Using his elevated senses of sight and smell, Gondar\'s hits have quite a good chance of success.','https://www.dotabuff.com/assets/skills/bounty-hunter-track-5288-4abae51defbcc8c6c0ecbd03dd4c20c1657d1c8711b84ff2e2ec9c8cf218d6f6.jpg'),
(246,44,'Acorn Shot','Fires Hoodwink\'s attack with an acorn at the target unit.  The acorn bounces to nearby targets, slowing them and dealing a percentage of Hoodwink\'s attack with bonus damage.If point targeted, a tree is created at the target position and the acorn will bounce to nearby targets.  The ability may be placed on alt-cast to force this behavior.','The same target can be hit more than once.Bounces will seek units in the fog of war in a 525 radius, but not invisible units.The planted tree lasts for 20 seconds.Acorn Shot benefits from attack range bonuses.','Though she\'ll make do with almost anything, Oak and Ironwood acorns make the most effective projectiles - and the bulk of Hoodwink\'s stash.','https://www.dotabuff.com/assets/skills/hoodwink-acorn-shot-8429-6fab2dfbd476dc00a0fcedcb6cb62fed4f63f5691778a6e2fbd2afd9f3a66987.jpg'),
(247,44,'Bushwhack','Tosses a net trap that stuns enemies if they are near a tree in the area.  Affected enemies take damage over time and are pulled towards the tree nearest to them within the target area, and have their vision reduced to 0 for the duration of the stun.','Units can be freed from the stun by destroying the tree.Bushwhack does not hit invisible units.','Hoodwink favors Ironwood groves for ambushes, but the wary step carefully in all areas of the mistwoods.','https://www.dotabuff.com/assets/skills/hoodwink-bushwhack-8158-002de15de8480775211dc18277741056d659479f7d1291cbf1621dcb20cba0d3.jpg'),
(248,44,'Scurry','Hoodwink gains bonus movement speed, phased movement, and tree-walking for a brief time.',NULL,'There\'s not a nook or cranny in the Wood Tomo\'kan out of reach of Hoodwink\'s paws.','https://www.dotabuff.com/assets/skills/hoodwink-scurry-9501-124e965bf7c1f77d0fbf9b9d9178745bbd3f6fc6b05e136b4c3f10d245eb3077.jpg'),
(249,44,'Decoy','Hoodwink turns invisible, increasing her movement speed, and creates a decoy illusion that starts aiming a decreased damage Sharpshooter at the nearest enemy hero. If the illusion is attacked or hit by a targeted ability, it is destroyed and it throws a lesser bushwhack towards the enemy.',NULL,NULL,'https://www.dotabuff.com/assets/skills/hoodwink-decoy-8107-dad245a5ebbce1bd2e9865419cf8d09b017df163c3ad37fb7ce22eed62b45bc0.jpg'),
(250,44,'Hunter\'s Boomerang','Tosses a boomerang in an arc. Upon contact, it returns to Hoodwink.  The boomerang will deal damage as it passes through or hits enemies, and apply a Hunter\'s Mark that causes affected enemies to be slowed and be more vulnerable to spell damage.',NULL,NULL,'https://www.dotabuff.com/assets/skills/hoodwink-hunters-boomerang-1422-621a82d67d111e165f1c71e4b5181c09e69c260ac58b14465b5d4ed4ada7c1b5.jpg'),
(251,44,'Mistwoods Wayfarer','Hoodwink has a chance to redirect enemy attacks to a nearby tree.','Trees that take a redirected attack are destroyed.',NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(252,44,'Sharpshooter','Hoodwink charges up and fires a deadly bolt from her crossbow, dealing heavy damage, break and slow to an enemy Hero.  The damage and debuff duration scale up to max after 3 seconds, and the bolt is fired automatically after 5 seconds.Hoodwink is knocked backwards for a distance of 350 from the force of the shot. Creeps hit by the bolt are damaged for half the values.',NULL,'While her first arbalest was a chance discovery, Hoodwink now takes great care in carving and caring for her own - of course with some necessary components pilfered or otherwise cleverly procured.','https://www.dotabuff.com/assets/skills/hoodwink-sharpshooter-8106-194f9accfe8925021d1885c80a49d29390d6ad5acd401301ec3952a81e090b0a.jpg'),
(253,44,'End Sharpshooter','Release the charged up shot, regain ability to move and attack.',NULL,'Fire!','https://www.dotabuff.com/assets/skills/hoodwink-end-sharpshooter-8159-3db7177e3db99e80785f7adfb341369651a060513705daa2347122315a97da33.jpg'),
(254,45,'Split Earth','Splits the earth under enemies. Deals damage and stuns for a short duration.','Split Earth will destroy trees in its area of effect.There is a 0.35 second delay before the effect is applied.','Twisting nature to his vile will, the shifting earth consumes those unlucky enough to cross Leshrac\'s path.','https://www.dotabuff.com/assets/skills/leshrac-split-earth-5241-b6c602ab22a929237f9f1d0e8f919031931ed72f2b39ec5b7a258a0d602ebf46.jpg'),
(255,45,'Diabolic Edict','Saturates the area around Leshrac with magical explosions that deal pure damage to enemy units and buildings.  The fewer units available to attack, the more damage those units will take.','The explosions will continue even if Leshrac is killed.Can damage buildings, Spell Immune units, and invisible units.','Chronoptic energy bursts from one plane to the other, evaporating anything it touches.','https://www.dotabuff.com/assets/skills/leshrac-diabolic-edict-5242-cbd8e8e6d6eee3085b617ac68f838bcc5a1d4b2d89feeca29a6e7c334fd1c702.jpg'),
