(263,46,'Eyes In The Forest','Treant Protector enchants a tree, which grants him unobstructed vision in that location. If Overgrowth is cast, units within a radius of an enchanted tree will be entangled and damaged. Passively causes all trees to respawn much faster.','Being entangled by Overgrowth through enchanted trees from Eyes in the Forest does damage.If the enemy has True Sight, they will be able to see which trees are enchanted.','One can never be too certain who, or what, might need protecting.','https://www.dotabuff.com/assets/skills/treant-protector-eyes-in-the-forest-5649-3b0f46a5aa1360645b69f9c837fa8b5a29d07f1124840dc02db7585d0cfba30f.jpg'),
