(276,48,'Ice Blast','Launches a tracer toward any location on the battlefield, which must be triggered again to mark the area to be blasted by a damaging explosion of hail. The further the tracer travels, the larger the explosion will be. Enemies caught in the explosion, or who touch the icy ball of hail as it travels, are Frostbitten, gaining Death Rime Stacks and prevented from regenerating or healing. If a Frostbitten unit\'s health drops below a certain percentage, they will instantly shatter.','Upon cast, this ability is replaced by Release, used to stop the tracer on the target area.The area of effect is 275 + 50*TimeTraveled, capped at 1000.Kill will be granted to the source of the damage that triggers the shatter.The shatter effect doesn\'t work on illusions.The HP Freeze prevents most kinds of healing, including the fountain, except Sunder, Time Lapse and Supernova.','Ice storms from ages past flow through Kaldr\'s frosty limbs, crashing into the world and turning its inhabitants into monuments to his eternal power.','https://www.dotabuff.com/assets/skills/ancient-apparition-ice-blast-5348-1f74542fb6c0b7bfe2434f0089361b25106c7760dfb4a92c90d0a8ff03b93ceb.jpg'),
