(289,50,'Stone Gaze','Any enemy units looking at Medusa will have their movement and attack speed slowed.  If 2 seconds of total time is accumulated looking at Medusa while Stone Gaze is active, that unit will turn to stone.  Petrified units are stunned, and take bonus physical attack damage.','Regardless of when a unit receives the Stone Gaze buff while the ability is active on Medusa, it will still receive the full debuff duration.','The beauty of Medusa is legendary.','https://www.dotabuff.com/assets/skills/medusa-stone-gaze-5507-4dcdc14160e3830ced2ac55fad51fc4da4c7d6edeaad585a07fab4b32ef6faac.jpg'),
