(292,51,'Multishot','CHANNELED - Drow releases a flurry of arrows in continuous salvos, hitting enemies for extra damage and applying Frost Arrows. Lasts up to 1.75 seconds.','Arrow base damage pierces magic immunity.Frost Arrows\' damage and slow do not pierce magic immunity.','In the ranger\'s youth, learning to fire multiple arrows at once was considered a distracting frivolity. In the war of the Ancients, such technique has become strange necessity.','https://www.dotabuff.com/assets/skills/drow-ranger-multishot-343-9f0b7e31d83b32f2ccc9afccfac68c1d4994d06a9482137effeb6c3623912daf.jpg'),
