(322,56,'Arctic Burn','Winter Wyvern soars upon an arctic wind, granting her unobstructed movement and allowing her to exhale a blistering chill into each attack. While soaring, her attacks travel further and faster, and slow enemies with a magical freeze that strips them of 4 / 6 / 8 / 10% of their current health each second.','Enemy units can only receive the Arctic Burn debuff once per cast.This ability does not affect Roshan.Reduces Winter Wyvern\'s attack point to 0.1.The damage and slow from Arctic Burn can be dispelled.','The same organ where some dragons stoke their inner flame is, in Auroth, a crucible of unimaginable cold. From deep within her frosty gullet, an exhalation sends enemies into burning agony.','https://www.dotabuff.com/assets/skills/winter-wyvern-arctic-burn-5651-3b70c23d66661d100e336ec4b72a688892dbaf6874098edfcb0ce5a8dd8b6b55.jpg'),
(323,56,'Splinter Blast','Launches a ball of brittle ice toward a unit. The ice shatters on impact, leaving the primary target completely unaffected, while hurling damaging splinters into nearby enemies in a 500 base radius. Enemies struck by these splinters are slowed by 28 / 32 / 36 / 40%.','The primary projectile moves at 1200 movement speed.The primary projectile cannot be disjointed and cannot be targeted towards Winter Wyvern herself.','Produced slowly by specialized vesicles in her frozen gullet, Winter Wyvern blast shards of ice at her enemies.','https://www.dotabuff.com/assets/skills/winter-wyvern-splinter-blast-5652-0f6c34329d3c18745a6c6ea5e8f6578950d075840d188f12e1c29d995695bcc5.jpg'),
