(327,57,'Icarus Dive','Phoenix dives forward in an arc with a fixed distance in the targeted direction, dealing damage over time and slowing the movement speed of any units it comes into contact with, and then orbiting back to its original position. If Phoenix casts Supernova, the dive ends.','Icarus Dive has a 2 second travel duration, and can be cancelled by casting the ability again while in flight.','Though no stranger to travelling the cosmic void, soaring within an atmosphere offers unique pleasures.','https://www.dotabuff.com/assets/skills/phoenix-icarus-dive-5623-65b44aacfcd5967d05ac0688d8a21723911a82708766d706ecb1cbf381d756fa.jpg'),
