(355,61,'Cinder Brew','Drenches himself and an area in alcohol, causing enemy units to move slower and ignite once they take any Magic or Pure damage. Duration is increased by 3 seconds when enemies are ignited. While Brewmaster is Brewed Up, His Drunken Brawler Stances are stronger. Dealing or receiving magic damage extends Brewmaster\'s Brewed Up duration.',NULL,'The Order of the Oyo\'s solution to all problems - another round!','https://www.dotabuff.com/assets/skills/brewmaster-cinder-brew-7310-5dd223b837c0e580e22c355f6d3e4a03f251841bf87848f2f2d09827e3f63693.jpg'),
(356,61,'Drunken Brawler','Brewmaster can switch stances based on the elements he controls, gaining passive bonuses that improve against enemies when Brewed Up.Earth Brawler - Grants 1 / 3 / 5 / 7 armor and 5 / 10 / 15 / 20% Magic Resistance. Bonuses are 2.5x when Brewed Up.Storm Brawler - Grants 15 / 20 / 25 / 30% evasion and 5 / 7 / 9 / 11% Bonus Move Speed. Bonuses are 2.5x when Brewed Up.Fire Brawler - Grants 20% chance to critical strike for 120 / 140 / 160 / 180% of your attack damage and 10 / 15 / 20 / 25 Attack Speed. Crit Chance and Attack Speed is 2.5x when Brewed Up. Void Brawler - Grants 5 / 10 / 15 / 20% bonus Status Resistance to Brewmaster and applies a 10 / 15 / 20 / 25% Slow for 2s on attack. Slow and Status Resistance are 2.5x when affected by Cinder Brew.','Stacks diminishingly with other sources of Evasion.','When Mangix won his title as the Brewmaster of the Order of Oyo, he also claimed his place in the mastery of inebriation.','https://www.dotabuff.com/assets/skills/brewmaster-drunken-brawler-5402-f827240c1310c812599d4922cae463979ebe25c86949a4cb8f44e88a7493bdc1.jpg'),
(357,61,'Primal Companion','Creates a Brewling based on Brewmaster\'s current Drunken Brawler Stance.A new Brewling cannot be resummoned for 3s if the current one takes damage from enemy Heroes or hero-controlled units. If the Brewling dies, the ability goes on cooldown for 70 seconds.Only one Brewling can exist at a time. If Brewmaster uses Primal Split, the existing Brewling disappears.',NULL,'Mangix doesn\'t hold to it by rule, but he vaguely recalls an old master musing that, if one could manage, scaring up a companion was always preferable to drinking alone.','https://www.dotabuff.com/assets/skills/brewmaster-primal-companion-942-2eda453b6a38c9eff7f3ca683f801e40a7406f72f033c6ba5a6e95694adbf450.jpg'),
