(411,71,'Trample','Primal Beast stomps over everything. For every 140 units traveled, all enemies around the Beast receive damage. Deals base damage plus a multiplier of Primal Beast\'s attack damage. Primal Beast is disarmed for the duration of the ability.',NULL,'As the only member of his species to arrive on this world, locals can only speculate on the Beast\'s size relative to his kin. Such observation would prove easier of course if the subject didn\'t eat everything it sees and destroy most of what it doesn\'t.','https://www.dotabuff.com/assets/skills/primal-beast-trample-994-7a1ee2965b965efb9af76efe145b39dd4a532e63230826d77dc0c31568045a96.jpg'),
(412,71,'Uproar','The Beast\'s temper passively provides bonus damage. Additionally, for every instance of 50 damage or more Primal Beast takes from enemy heroes, he accumulates stacks of Uproar.  When activated, Primal Beast releases a roar that slows surrounding enemies and grants the Beast additional attack damage and armor for 7 seconds based on his current stacks of Uproar.','Break disables the passive bonus attack damage.Break disables the gaining of new stacks.','Already draped in a broken patchwork of barding and chains upon appearing in the mistwoods, the Beast tolerates no further attempts at subjugation.','https://www.dotabuff.com/assets/skills/primal-beast-uproar-995-41b79f8ce7a3ae46b124b4990c964a6e69d99bb1313ee1a24cc15db73d77dae7.jpg'),
(413,71,'Rock Throw','Primal Beast throws a rock at the target location that stuns and damages enemies. The rock cannot be thrown within a minimum range of Primal Beast. After landing, the rock splits into 3 additional fragments that land behind the initial target location. Rock Throw increases stacks of Uproar for each hero hit.',NULL,'AGAIN WITH THE ROCKS!','https://www.dotabuff.com/assets/skills/primal-beast-rock-throw-7739-70bb91f2945498c163345fcb5faf597117d3b4e63b98ef36b3b08ec6886ecf20.jpg'),
