(415,71,'Pulverize','CHANNELED - Primal Beast channels his rage, grabbing the target enemy and slamming them into the ground repeatedly, damaging and mini-stunning any enemies caught in the AoE. Each consecutive hit deals bonus damage. Lasts 2.3 seconds.',NULL,'Though none are certain whether his utterances have true meaning, most concede the Beast\'s powerful grip and tendency to smash his enemies into naught but pulp and pieces communicates his intent well enough.','https://www.dotabuff.com/assets/skills/primal-beast-pulverize-996-ca30acd30458a4beb98113b7902cb7add70857f78ed0470b3fb18ceb57fdde1e.jpg'),
(416,71,'Colossal','Primal Beast deals 40% more damage to buildings.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(417,72,'Tether','Tethers Io to an allied unit, granting bonus movement speed to both. When Io restores health or mana, the tethered unit gains a portion of that amount. The tether breaks when the allied unit moves too far away, or Io cancels the tether. Tether slows and damages enemies touching it.','If you try to tether a unit that is 700 distance or further away from Io, he will latch on and pull himself closer to the tethered unit (to a distance of 300).The tethered unit will heal faster and will heal even if Io is at full health.Io\'s movement speed matches the tethered unit\'s.','The benevolent touch of Io brings strength from between the planes.','https://www.dotabuff.com/assets/skills/io-tether-5485-48ab0a7eb86787fba8e12d56885479848e17eb17a9d996ac827f56006cf144d4.jpg'),
(418,72,'Spirits','Summon five particle spirits that dance in a circle around Io. If a particle collides with an enemy hero, it explodes, damaging all enemy units in an area around it.  Creeps take minor damage from touching a particle spirit, but do not cause them to explode.  When its duration ends, any remaining Spirits explode.','After summoning, Io can call the spirits in and out.','Io twists the particles of the universe with its unimaginable capabilities.','https://www.dotabuff.com/assets/skills/io-spirits-5486-014e126c134082c966188189c269c840addcd5c72cc3d760bfd9d5bf120ebd50.jpg'),
(419,72,'Overcharge','Io gains health regeneration based on max health.  If Io is Tethered to an ally, that unit also gains any bonuses granted by Overcharge.',NULL,'Drawing on the energy of matter from all worlds, Io begins the unravelling of time.','https://www.dotabuff.com/assets/skills/io-overcharge-5487-81f084f97261ca9cc0fb6e8e78d837a78effb606db6e04ed0fda8ca95e427f28.jpg'),
(420,72,'Spirits In','Sends the spirits closer to you. Can be toggled on and off.',NULL,NULL,'https://www.dotabuff.com/assets/skills/io-spirits-in-5490-bb7dbff7fdb590d70a973e2067a3fa2630ffb905bf34283f59b23728840b0237.jpg'),
