(422,72,'Relocate','Teleports Io and a tethered ally to any location. After the spell expires, Io and the tethered ally will return to their original location. Double-click to teleport to your team\'s base fountain.','Enemies receive a visual indicator in the world and on the minimap of the target location during the cast delay.If Io is disabled during the cast delay, Relocate is cancelled.If an allied hero is Tethered, that hero will teleport along with you. You can break the tether at any time to prevent that hero from teleporting with you.Only heroes, creep heroes, and illusions can be relocated.','Io is the embodiment of the mystery of the universe.','https://www.dotabuff.com/assets/skills/io-relocate-5488-8f8f2a833fc063e60535c6887b5dc83c92f4487d6b6f0512983759d6e5560f16.jpg'),
