(425,73,'Time Walk','Rushes to a target location while backtracking any damage taken the last 2 seconds.','Faceless Void is invulnerable while using Time Walk.','Darkterror tears a hole in time, passing through Claszureme, and appearing back in an instant.','https://www.dotabuff.com/assets/skills/faceless-void-time-walk-5182-8bcd769bb648a61780f0204ce736a7e1fa91fb0da2c54f152b524c3638673724.jpg'),
(426,73,'Time Dilation','Faceless Void traps all nearby enemies in a time dilation field for 8 / 9 / 10 / 11 seconds, extending their cooldowns and slowing their movement and attack speed by 7 / 8 / 9 / 10% for each cooldown extended. Deals bonus damage per second for each cooldown. The debuff does not tick down while inside Chronosphere.','Does not affect item cooldowns.','For those facing off against Darkterror, each moment seems to stretch into eternity.','https://www.dotabuff.com/assets/skills/faceless-void-time-dilation-5691-73d56d7e430ac4b1c0cafa23645862457b514a8c601cf686fd4eba216763aa0f.jpg'),
