(428,73,'Reverse Time Walk','Available for 1.5 seconds after landing Time Walk. If used in this period, you will reverse your time walk back to your previous cast location. Does not affect health or proc scepter hits.',NULL,NULL,'https://www.dotabuff.com/assets/skills/faceless-void-reverse-time-walk-8030-e8537023f36ab27ea002f2295fecb2685bef66c10cba4206a8073eb92aa0df9f.jpg'),
