(430,73,'Chronosphere','Creates a blister in spacetime, trapping all units caught in its sphere of influence and causes you to move very quickly inside it.  All ability and item cooldowns are frozen. Only Faceless Void and any units he controls are unaffected. Invisible enemies in the sphere will be revealed.','Pauses all units and buildings, friendly or enemy, except those owned by Faceless Void.Faceless Void is never affected by Chronospheres with any owner.','When a rift opens to Claszureme, all poor souls caught within will likely never return.','https://www.dotabuff.com/assets/skills/faceless-void-chronosphere-5185-730d361fad9eb2706faa08bcbb3cfab65b8649afb3c65df92ad7913e0f4c9848.jpg'),
