(432,74,'Dispose','Marci grabs an allied or enemy target and throws it effortlessly behind her, damaging and slowing the unit if it\'s an enemy. Any enemy units in the landing area will also be damaged and slowed.',NULL,'Marci excels at removing obstacles from Princess Mirana\'s path.','https://www.dotabuff.com/assets/skills/marci-dispose-8192-2f9e512792d3dc7bcdf506c82176d6d0920f7878b75fe4da1ffac044beca4e8e.jpg'),
(433,74,'Sidekick','Marci\'s loyalty helps ensure survival, imbuing a chosen allied hero and herself with shared lifesteal and attack damage. If Marci and her ally are further apart from each other than 2500, the ally receives no bonuses and Marci only gets 50% until they get close again. Marci\'s lifesteal also heals her ally and the ally lifesteal also heals Marci.','Marci cannot cast Sidekick on herself.Lifesteal effectiveness gets a 40% penalty against creeps.','Marci learned at a young age that the best asset in a scrap is a steady companion.','https://www.dotabuff.com/assets/skills/marci-sidekick-1426-9cf6707ed1f78ebab3a2d04a388e3d47073ce4e65609379684b7d876fe43ef1b.jpg'),
(434,74,'Bodyguard','Marci protects an allied hero. For 6s, whenever the ally attacks or is attacked by an enemy, Marci counter-attacks that target if they are within her attack range plus 125. The ally also gains bonus armor and healing from Marci\'s lifesteal for the duration. Passively grants Marci lifesteal and bonus attack damage.','Marci cannot cast Bodyguard on herself.Lifesteal effectiveness gets a 40% penalty against creeps.Marci\'s counter-attack has a 0.45s cooldown.',NULL,'https://www.dotabuff.com/assets/skills/marci-bodyguard-1427-9cf6707ed1f78ebab3a2d04a388e3d47073ce4e65609379684b7d876fe43ef1b.jpg'),
(435,74,'Rebound','Marci bounds to the targeted allied unit, choosing a direction and distance she will spring away from it. Upon reaching the unit, Marci lunges to her final destination, damaging and stunning enemies where she lands. The ally receives 25 / 30 / 35 / 40% bonus movement speed for 5s.','Has 0 minimum jump distance.Marci\'s initial run to her target unit can be disjointed.Does not trigger spell reflect.','With a friendly or brazen boost, Marci can find her way into the midst of any fight.','https://www.dotabuff.com/assets/skills/marci-rebound-8235-e6dfa2032f8149d4ec9519980b70098667e86a0f3d98835fe466845533eff450.jpg'),
(436,74,'Special Delivery','All allied couriers gain 3 bonus levels and 1 bonus health.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(437,74,'Unleash','Marci taps a hidden power, gaining Fury charges that allow her to deliver a rapid sequence of strikes that slow movement and attack speed of the target for 2s. The last strike in every Fury combo creates a damaging pulse around the target. In between Fury combos, Marci is unable to attack for 1.5s.Marci gains 15% movement speed when Unleash is cast.','Once a Fury combo is started, each attack must be delivered within 1s or the Fury combo expires.Removes attack speed limit.','Though some have sought to understand its origins, Marci rebuffs all attempts to divine the source of her power.','https://www.dotabuff.com/assets/skills/marci-unleash-8198-10ffb1697ba6074aa0f53193867c2c69ccabcea397528cd9af21a41b012bbe4b.jpg'),
(438,75,'Starbreaker','Dawnbreaker whirls her hammer around 3 times, damaging enemies with her attack plus bonus damage. On the final strike, she smashes her hammer down, stunning and damaging enemies in front of her.','Dawnbreaker travels at a rate of 215 for the duration of the ability and takes a brief 0.2s to recover after the final strike.Celestial Hammer or Solar Guardian cannot be cast during the combo.Cleave does not work with this ability.Can be self-cast to move forward','Across the vast lineage of star progeny, there were multitudes unwilling to align with the aims of the Children of Light. To those who dared organize defiance, the Children would dispatch Valora and her hammer to show a measure of their power-to leave the rebels either shattered or set back to rights.','https://www.dotabuff.com/assets/skills/dawnbreaker-starbreaker-7902-6ca16b45ae8b1377d34e68e84d462f5b3f3234686502c64545575435378f32e6.jpg'),
(439,75,'Celestial Hammer','Dawnbreaker hurls her weapon at a target, damaging enemies struck along the way. The hammer pauses for 2 seconds at the destination before flying back to her, leaving a trail of fire that slows enemies. Dawnbreaker can recall the hammer at any time, pulling her towards it so they meet in the middle.','The hammer damages enemies both when thrown and when returning to Dawnbreaker.Dawnbreaker\'s Converge movement distance is capped at the ability\'s cast range.Starbreaker cannot be cast while the Hammer is out.','The Brightmaul is Valora\'s oldest companion and sole remaining connection to the glow of her creators.','https://www.dotabuff.com/assets/skills/dawnbreaker-celestial-hammer-7914-ec737e095c009fde5d082c98ff398daf85c8f938ad91fdccf4d7135fb8d176f3.jpg'),
(440,75,'Luminosity','After a number of attacks, Dawnbreaker powers up, charging her next attack with a critical hit that heals all allied heroes within 650 units around her for a portion of attack damage dealt. Creeps and neutral enemies provide less healing. Allies are healed for 50% of the amount.','Luminosity Heal is considered a lifesteal and increased by sources of Lifesteal Amplification.Break disables the gaining of new stacks.','Diminished in power without access to the Children\'s replenishing light, Valora can still recharge herself and her allies by creating order from the chaos which resides within each fight.','https://www.dotabuff.com/assets/skills/dawnbreaker-luminosity-7918-8a2ac79f283a13c486490b58628466948d14f096aba43cc71221aa10bc5ec0b8.jpg'),
(441,75,'Converge','Dawnbreaker recalls her hammer, pulling them together so they meet in the middle.',NULL,NULL,'https://www.dotabuff.com/assets/skills/dawnbreaker-converge-7903-4ef145dcb8026214a11fdf2a2b6c0f961d7c488e709db4442683a128dccc3fe9.jpg'),
(442,75,'Break of Dawn','Whenever the sun comes out, Dawnbreaker reveals the whole map to allies for 5 seconds.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(443,75,'Solar Guardian','CHANNELED - Dawnbreaker creates a pulsing effect at a location within 350 units of an allied hero anywhere on the map, damaging enemies and healing allies with each pulse. After a short duration, she flies to the target location, dealing additional damage and stunning enemies upon landing. Once channeled, Dawnbreaker cannot stop the ability.','Pulse interval is 0.5s.Total duration flight duration is 1.7 seconds of channel time + 0.8 of flight time.Cannot be cast without the Hammer.','Only in defense of an ally will Valora relent to call upon the last reserves of her old powers that still allow cosmic flight.','https://www.dotabuff.com/assets/skills/dawnbreaker-solar-guardian-7906-f06586a3fd48c6e3b744cfa55c6cb316d9acbc7ee69f9589e80f645805e52b48.jpg'),
