(445,76,'Earthbind','Tosses a net at the target point, rooting down all enemy units in an area around it.','Affects invisible units, revealing them.Does not work on Debuff Immune units or Roshan.','Catching dinner in the Riftshadow Ruins can be quite the task.','https://www.dotabuff.com/assets/skills/meepo-earthbind-5430-2c0c0e1a193728bdfaf2fe12fb9f312d4b455410c1aadc32456ef53b3723ab41.jpg'),
(446,76,'Poof','Drawing mystical energies from the earth, a Meepo can teleport to another Meepo or itself after channeling for 1.5 seconds, damaging the enemy in both the departure and arrival locations. If the ability is in alt-cast state, all Meepos will also cast Poof to the target. When cast on the ground, all Meepos except the selected one will Poof to the closest location.','Can be cast through the minimap.Can teleport to Meepo illusions.','Sometimes breaking one of the Riftshadow Crystals can be just the trick for getting yourself out of a bind.  Or your other self.','https://www.dotabuff.com/assets/skills/meepo-poof-5431-709932c8eacfdaf47dd08589f0fa350ea5f4f77c2466fd1045e9276871594b0c.jpg'),
