(449,76,'MegaMeepo','Primary Meepo mounts all other Meepos in a 600 radius around him on top of his shoulders. While in this form, he gains 40% of the other Meepo stats and can Fling them at enemies, dealing damage and slowing them. When cast, Earthbind generates additional nets and Poof deals bonus damage based on the amount of Meepos riding on top.',NULL,NULL,'https://www.dotabuff.com/assets/skills/meepo-megameepo-1109-68a0386003b6d4d4413738abf9ed0f0370ecb5fda5b7f316056d41c97ea701fb.jpg'),
(450,76,'Divided We Stand','Meepo summons an imperfect, semi-autonomous duplicate of himself, which can gain gold and experience as he does and shares his experience, attributes and abilities. However, the clones cannot wield any items but the boots that Meepo himself wears.  If any of the clones die, they all die. Divided We Stand grants all Meepos bonus Magic Resistance.','Clones can\'t use Arcane Boots, Guardian Greaves.','Do I know you?','https://www.dotabuff.com/assets/skills/meepo-divided-we-stand-5433-5dcd2c31b5f078df4e732c55d9562a5621cee1a1a5edeb6a2029f7d38a51fc31.jpg'),
