(453,77,'Dark Pact','After a short delay, Slark sacrifices some of his life blood, purging most negative debuffs and dealing damage to enemy units around him and to himself.  Slark only takes 30% of the damage.DISPEL TYPE: Strong Dispel','1.5 seconds after cast, a series of 10 pulses separated by 0.1 seconds deal the damage.Each pulse also removes debuffs from Slark.You can\'t kill yourself with this skill.The pulses stop if Slark dies.','Slithereen are capable of quickly regrowing appendages, in case of critical injury, to save their own lives.','https://www.dotabuff.com/assets/skills/slark-dark-pact-5494-9766f30e5768f7cbcbab8af3431081d2fa780d191c86b961596d04daec12c631.jpg'),
(454,77,'Pounce','Slark leaps forward, leashing the first hero he connects.  That unit can only move a limited distance away from Slark\'s landing position.','On cast, Slark leaps forward at a speed of 933.33, stopping when he latches onto an enemy hero or has traveled 700 distance.Debuff Immune units cannot be leashed.Trees will be destroyed around Slark\'s landing location.','Time in the Dark Reef made Slark a dangerous assassin; aggressive and fearless.','https://www.dotabuff.com/assets/skills/slark-pounce-5495-f2f4e57f250ba07f326f9171fbfffa06edad071d00ff1f301e0f74303249ef00.jpg'),
(455,77,'Essence Shift','Slark steals the life essence of enemy heroes with his attacks, draining each of their attributes and converting them to bonus Agility. If Slark kills an affected enemy hero, he permanently steals 1 Agility.','Attributes cannot be dropped below 1.Essence Shifted stats are returned to normal on death. The stat return for Slark and for the affected hero are separate.To permanently steal Agility, Slark doesn\'t need to land the killing blow, as long as the enemy hero is killed within Slark\'s Steal Radius while having the Essence Shift debuff.Break disables the gaining of temporary stacks. Does not disable the gaining of permanent stacks.Break does not disable the bonuses of existing stacks.','With each strike at his adversaries, Slark\'s knowledge of their weaknesses improves.','https://www.dotabuff.com/assets/skills/slark-essence-shift-5496-4b26f8d3ab59b6561806677cc9f7b077870e2b1bc02adfe713873876cdfea955.jpg'),
