(457,77,'Barracuda','When not visible to the enemy team, Slark gains bonus movement speed and health regeneration.','If Slark is damaged by a neutral unit, the passive movement and health regeneration bonuses are lost for 2 seconds.',NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(458,77,'Shadow Dance','When used, Slark hides himself in a cloud of shadows, becoming immune to detection. Attacking, casting spells, and using items will not reveal Slark.',NULL,'The hidden Thirteenth is a slippery foe.','https://www.dotabuff.com/assets/skills/slark-shadow-dance-5497-1e16e99eb00f1e538f9a403526a8496d1c2ba2834dbbeb62faeea2ea386b82a6.jpg'),
(459,78,'Bramble Maze','Dark Willow creates a 500 AoE maze of 8 brambles that grow in the target area after 0.3 seconds. Enemies that walk into a bramble are rooted and take damage over time. Lasts 12 seconds.','Does not interrupt channeling spells upon rooting.','The fae realm exists all around you, merely waiting to draw you in...','https://www.dotabuff.com/assets/skills/dark-willow-bramble-maze-6339-780c536b4f1dd9be9616f0dd9de026fde7046525fc55431168aff1fdc9ad6a0a.jpg'),
(460,78,'Shadow Realm','Dark Willow recedes into the shadows, becoming untargetable.  Her next attack has 600 bonus attack range and deals bonus magic damage, and will end Shadow Realm. Damage scales based on how long she remains under the effects of Shadow Realm, the maximum being reached after 3 seconds.','Disjoints projectiles upon cast.Grants phased movement.Spells which require vision cannot affect Dark Willow in the Shadow Realm.','What you can\'t see will most definitely hurt you.','https://www.dotabuff.com/assets/skills/dark-willow-shadow-realm-6341-e749c637882dfdf2e7141c9694dbb34703f323671af518938668cb3992057f69.jpg'),
