(578,97,'Song of the Siren','All enemies in range of the Naga Siren are put into a magical stasis where they cannot act or be attacked. Allies in range recover a percentage of their health per second. Using Song of the Siren again will end the duration early.','Units affected by Song of the Siren are invulnerable and cannot take damage from any source.Doesn\'t affect Debuff Immune units.The area of the song follows Naga, so if she moves far enough away from affected units, they will wake up.','Slithice\'s powerful voice enchants leagues of opponents, while calling her Slithereen kin in a time of need.','https://www.dotabuff.com/assets/skills/naga-siren-song-of-the-siren-5470-343988c8bbb1b15e0354240e5da687e6dc9afc6309727a18218b0b63b87ac1f8.jpg'),
