(582,98,'Shadow Poison','Deals damage in a line, and afflicts enemy units with a poison effect. The poison deals 1/2/4/8/16 times the stack damage based on the number of stacks on the target, up to 5 stacks. Additional stacks cause 24 / 36 / 48 / 60 damage each.  This deferred damage is dealt when Shadow Poison\'s duration is expired, or the Release sub-ability is used.','Shadow Poison can affect units under Disruption.','The ever growing influence of the Shadow Demon can pollute the most valiant and pure of heroes.','https://www.dotabuff.com/assets/skills/shadow-demon-shadow-poison-5423-1f5bb57921ae0056484eea2f1f64955f5cb237d0806e6c38dfe9981544938b45.jpg'),
