(584,98,'Demonic Cleanse','Cleanses the target allied unit, removing negative buffs for the duration.  At the end of the duration, the unit is healed. Units under the effect of Disruption can still be affected by Demonic Cleanse.DISPEL TYPE: Basic Dispel','Can be cast on invulnerable units.Negative buffs are continously removed from the target for the duration of the Cleanse.',NULL,'https://www.dotabuff.com/assets/skills/shadow-demon-demonic-cleanse-916-cc2d4f22a381f1c62e6b7cbda893da10ff608ede3877eb0786d3a5933471bf14.jpg'),
(585,98,'Demonic Purge','Purges the target enemy unit, removing positive buffs, and slowing the target for the duration.  The unit slowly regains its speed until the end of the duration, upon which damage is dealt.  Units under the effect of Disruption can still be affected by Demonic Purge.DISPEL TYPE: Basic Dispel','The slow starts at 100% and decreases over time to 20%.Positive buffs are continously removed from the target for the duration of the Purge.Can be cast on invulnerable units.','Once Shadow Demon no longer has any need for his collected cultist, he releases it from its subservience - and its life.','https://www.dotabuff.com/assets/skills/shadow-demon-demonic-purge-5425-ae6de7967e634c794fc8ce46f630e43614fec7e0e4ce14b3741cff223d8eee58.jpg'),
(586,98,'Menace','Shadow Demon\'s Attacks apply a stacking 2% Amplify Damage debuff to the enemy for 8 seconds.','Break disables the application of new stacks.Break does not disable the effects of existing stacks.',NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
