(589,99,'Corrosive Skin','Viper exudes an infectious toxin that damages and slows the attack speed of any enemy that damages it in a 1200 radius. The acid exudate also increases Viper\'s resistance to magic.','Stacks multiplicatively with other magic damage resistance sources.Break prevents the application of Corrosive Skin. Does not disable Corrosive Skin application from Nosedive.','It is not unusual for sword and shield alike to corrode in the very hands of those who attack the Netherdrake.','https://www.dotabuff.com/assets/skills/viper-corrosive-skin-5220-3de1702bbedb86a0876089d584985349bb7e0b5875deb80076ec5e53c11e1b37.jpg'),
(590,99,'Nosedive','Viper slams into the ground, splattering each enemy in a 500 AoE for 4 seconds with the effect of Corrosive Skin.','Cannot be used while Leashed or Rooted.','It was thought that Netherdrake wings touch ground only in death, but some surmise that those who\'ve witnessed more intentional landings merely haven\'t survived to tell the tale.','https://www.dotabuff.com/assets/skills/viper-nosedive-983-d0fced448099181d5dd84860360201d08ee2aa69c01153396c3384698cf260a2.jpg'),
