(592,99,'Viper Strike','Viper slows the targeted enemy unit\'s movement and attack speed while also disabling their passives and dealing poison damage over time. The slowing effect reduces over the duration of the poison.',NULL,'Once used to slay his sadistic summoner, the most powerful of Netherdrake infections spreads through the veins of those foolish enough to cross Viper.','https://www.dotabuff.com/assets/skills/viper-viper-strike-5221-d02331474ffc5367292d8462b43b425040c2ba4534aae898526670bdeb5b8ba9.jpg'),
