(594,101,'Devour','Consumes an enemy or neutral creep, acquiring any special abilities that it possessed. If alt-cast is deactivated, Doom will not acquire the creep\'s abilities. Duration is equal to the cooldown.','Gives Doom the original bounty of the creep, along with the bonus gold.If you devour a creep without abilities, you\'ll keep the abilities you had previously.','Lucifer\'s appetite and greed are never sated.','https://www.dotabuff.com/assets/skills/doom-devour-5339-5f9269053c974f305aeb9d8764b71c4d05168ef385e178efbb047649883c6d19.jpg'),
(595,101,'Scorched Earth','Carpets the nearby earth in flames which damage enemies, while also granting him increased movement speed.','Scorched Earth follows Doom, centered on his location.','The Fallen One spreads destruction in his wake, sparing none from the flame which sustains him.','https://www.dotabuff.com/assets/skills/doom-scorched-earth-5340-16ae3f9a5500f778f5d016d016d95fd5ff9b190898e12b3b0037f536c5724702.jpg'),
