(599,102,'Rocket Barrage','Launches a salvo of rockets at nearby enemy units in a radius around the Gyrocopter. Lasts 3 seconds.','Rocket Barrage can\'t hit units Gyrocopter has no vision over.Rocket Barrage fired from Homing Missiles do not trigger Afterburner.','Aurel\'s new craft has an increased payload for rockets, enhancing their rapid-fire capabilities.','https://www.dotabuff.com/assets/skills/gyrocopter-rocket-barrage-5361-139ec935171869575d7df5a1c515b24b622440d2124e5c3bd0c41902f0cf0173.jpg'),
(600,102,'Homing Missile','Fires a homing missile to seek the targeted enemy unit. The missile gains speed over time, dealing damage and stunning when it impacts the target. Enemy units can destroy the missile before it reaches its target.','Towers do half damage to the missile.The crosshair effect is visible to allies only.The missile will follow and hit invisible units.','The biggest missile Aurel could possibly attach to his craft, The Bomb has carefully calculated aerodynamics and explosives for maximum impact.','https://www.dotabuff.com/assets/skills/gyrocopter-homing-missile-5362-96a6e6c192b9bd9b796857a289f4d45436278fe56f07ad795efd6cdcd3267878.jpg'),
