(602,102,'Chop Shop','Gyrocopter can disassemble most items.','Cannot disassemble Divine Rapier or Hand of Midas.Gyrocopter can always sell recipes for full value.',NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
