(604,103,'Spear of Mars','Mars throws his legendary Spear with deadly precision, damaging each enemy unit it strikes. The first enemy hero it hits is skewered on the spear, pushing it back. If a skewered hero hits a tree, building, or cliff, they will be impaled to it and stunned.','Spear of Mars can hit invisible units and reveals them if they are stunned.Spear of Mars will only pin a unit to cliffs onto elevated areas, otherwise it will push them off onto lower ground.','The legendary Spear of Mars still glows with the heat of the forge god\'s fires.','https://www.dotabuff.com/assets/skills/mars-spear-of-mars-6583-ce60e3d54be46dbfb7b2fd3982ba9b45f1f5c31e4ecb27e300da8e2b915d038f.jpg'),
(605,103,'God\'s Rebuke','Mars smashes enemies in front of him with his shield, knocking them back and damaging them with a critical hit based on his attack. Bonus damage is added when hitting heroes. Has True Strike.','Attack modifiers have a chance to proc on God\'s Rebuke attacks.','There isn\'t a warrior alive who can stand unmoved by the sting of Mars\' rebuke.','https://www.dotabuff.com/assets/skills/mars-gods-rebuke-6495-cd6c55836488b36d78e386c50a4d4e1696b719acdea42611a761376f0cc91571.jpg'),
(606,103,'Bulwark','Mars wields his massive shield to block a portion of each physical attack when hit from the front or sides. Can be toggled, granting phased movement, removing Mars\'s ability to attack, and locking the direction he is facing. When active, reduces movement speed and re-directs 70% of the attack projectiles aimed at Mars\'s allies towards Mars instead.','Redirect only works if the projectile targets are in a cone behind Mars or within 100 range of him.Break disables the front and side damage reduction.','Only the very foolish dare to fight fair with the god of war.','https://www.dotabuff.com/assets/skills/mars-bulwark-6582-144b92fa2a37ac7ee0ed8035f25eae9137be1913e2e35cf09f2d5c3644526931.jpg'),
(607,103,'Dauntless','Mars and allied heroes within 2000 units get more HP Regen the more they are outnumbered by enemy heroes in that area.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(608,103,'Arena Of Blood','After a short formation time, Mars summons an arena lined with the undead warriors of the Ash Legion, who block enemy attacks and movement. Enemy heroes near the inside edge of the arena will be attacked by spears, dealing damage and knocking them back.',NULL,'The long-dead members of the Ash Legion, assembled from the finest warriors to ever test the might of Mars, still revel in the thrill of combat, gladly beholden to the hand that fell them for as long as he so commands.','https://www.dotabuff.com/assets/skills/mars-arena-of-blood-1416-1e09107071e5e448561b5db8c7f896963cacaefb4543e3c35df55677138e8a97.jpg'),
(609,104,'Boulder Smash','Earth Spirit smashes the target enemy or ally, sending them in the direction he is facing. If Earth Spirit targets an area, he will smash the nearest unit in a 200 radius, prioritizing Stone Remnants. The travelling unit or Remnant damages all enemy units it hits.  If an enemy is hit by a Stone Remnant, they are also slowed. Stone Remnants travel further than other units. Deals 1.4x damage to creeps.',NULL,'It is with the power of a mountain that Earth Spirit strikes his enemies.','https://www.dotabuff.com/assets/skills/earth-spirit-boulder-smash-5608-75418fdb5cedce1bd33d10a86ce760998e2b05c9a24115c0c80f7e1fb57fd1e9.jpg'),
(610,104,'Rolling Boulder','Earth Spirit gathers himself into a boulder and, after a 0.6s delay, rolls toward the target location, dealing 60 / 70 / 80 / 90 + 100% STR damage and stunning enemy units. He will stop if he collides with an enemy hero or is stunned. If he rolls over a Stone Remnant, he will travel further and faster, and stun enemies for longer.','Rolling over a Stone Remnant will destroy the Remnant.The boulder has a radius of 160.','Calling upon his connection to the land, the Earth Spirit draws loose stone to him, which forms a protective ball that he can use to roll short distances.','https://www.dotabuff.com/assets/skills/earth-spirit-rolling-boulder-5609-09c157fa4cace61aa942327d0ba65d40a2ee9ed085475133395ff48e131f8bbb.jpg'),
(611,104,'Geomagnetic Grip','Earth Spirit pulls the target Stone Remnant. Enemies struck by the gripped target will be silenced and take damage.','Will not work on a unit inside Chronosphere, Duel, or Black Hole.Geomagnetic Grip can also target allied creeps.','Like calls to like. Even the minerals found in the blood and bones of living beings are not immune to the call of the Earth Spirit.','https://www.dotabuff.com/assets/skills/earth-spirit-geomagnetic-grip-5610-a3a22acfd9d2a2cc3c59adf1819ebf540c8523e27e78c4adfa0f40db91b92ff4.jpg'),
(612,104,'Stone Remnant','Call a Stone Remnant to the target location.  Stone Remnants have no vision and are invulnerable, and can be used with Earth Spirit\'s abilities.  Calling a Stone Remnant consumes a charge, which recharge over time. Gains additional charges every 5 hero levels.',NULL,'Earth Spirit calls forth a remnant of his stone army, long buried with him in the dark embrace of the Earth.','https://www.dotabuff.com/assets/skills/earth-spirit-stone-remnant-1395-05fb68851f01bc23083997c60f84680b0e3cd907758a95f7c3447e69fb19409b.jpg'),
(613,104,'Enchant Remnant','Earth Spirit temporarily enchants a hero, granting them the properties of a Stone Remnant. After a short duration the remnant shatters, releasing the hero and damaging nearby enemies. < br>Can be cast on Stone Remnants. Has a 5 second cooldown when used that way.Has a larger cast range when cast on an ally hero.','Earth Spirit himself can be targeted by Boulder Smash if he is enchanted.','Kaolin uses the elemental power of the Earth to temporarily petrify living beings, so that they might be conscripted into his stone funerary army.','https://www.dotabuff.com/assets/skills/earth-spirit-enchant-remnant-5648-1460eb701900c0bac80b836b21565b51481c5a822be0b58b1e52740c22bcd656.jpg'),
(614,104,'Magnetize','Magnetizes units in a small nearby area, causing them to take damage for a short duration. Magnetized heroes cause nearby Stone Remnants to explode, destroying the remnant and refreshing Magnetize\'s duration on all nearby enemies. This process can repeat multiple times. If an enemy hero is affected by Geomagnetic Grip or Boulder Smash, all magnetized heroes share the effects.',NULL,'At the Earth Spirit\'s call, the minerals in the blood and bones of his enemies rebel against the bodies they find themselves in.','https://www.dotabuff.com/assets/skills/earth-spirit-magnetize-5612-6e5e73b39cefda5d5676ab76c79d4af176c451c38c945e937ad43157fa7f90d3.jpg'),
(615,105,'Illusory Orb','Puck launches a magic orb that floats in a straight path, damaging enemy units along the way. At any point, Puck may teleport to the orb\'s location using Ethereal Jaunt.','The Illusory Orb grants unobstructed vision around its location while it travels.Jaunting to the Orb will disjoint projectiles.','The playful Faerie Dragon delights in confusing others, vanishing and reappearing where unexpected.','https://www.dotabuff.com/assets/skills/puck-illusory-orb-5069-1711f7a4de0da2f433b62b87b40d7968908152e04302abe44d3992824ea57926.jpg'),
(616,105,'Waning Rift','Puck teleports to the target location and releases a burst of faerie dust that deals damage and silences enemy units nearby.',NULL,'With a mischievous grin, Puck spreads its enchanted powder which disrupts magical flow.','https://www.dotabuff.com/assets/skills/puck-waning-rift-5071-96a937008fcddc8a113d0424346105c1835c9eaecc3130f1fb8f308c48320286.jpg'),
(617,105,'Phase Shift','CHANNELED - Puck briefly shifts into another dimension where it is immune from harm.','Puck retains collision size while under the effects of Phase Shift.Issuing any action will cancel Phase Shift.Puck is invulnerable during Phase Shift.','With a quip and flash, Puck returns to the alien dimension from whence it came.','https://www.dotabuff.com/assets/skills/puck-phase-shift-5072-06d109ed2662cea7c611e9210327d846418db90591d983bf5d29fb42ac98952c.jpg'),
(618,105,'Ethereal Jaunt','Teleports Puck to a flying Illusory Orb.',NULL,NULL,'https://www.dotabuff.com/assets/skills/puck-ethereal-jaunt-5070-79997761337ebdee779d6eb95b138927dd1f91271857c1bbcfd74325a528a74b.jpg'),
