(620,105,'Dream Coil','Creates a coil of volatile magic that latches onto enemy Heroes, damaging and leashing them.  If the enemy hero stretches the coil by moving too far away, it snaps, stunning and dealing additional damage.',NULL,'The Faerie Dragon sows confusion by forcing its enemies to vividly dream about their own mortality.','https://www.dotabuff.com/assets/skills/puck-dream-coil-5073-2f9eb11ca05700f3d049cfe3c4e293f8c29959dfa72c8078286c7757c8d9a6b6.jpg'),
