(622,106,'Reactive Tazer','Techies trigger an electric charge giving them bonus movement speed for a short period of time. Enemies attacking Techies are temporarily disarmed and get a Basic Dispel. At the end of the effect, the charge explodes, disarming all enemies within the radius.',NULL,'A steady bomb hand prefers an abundance of personal space.','https://www.dotabuff.com/assets/skills/techies-reactive-tazer-886-962277aabcfe75ba3dd1de9d3a3db08533fa5a49c820d7947c3cc5e1d33a78c6.jpg'),
(623,106,'Blast Off!','Techies hurtle themselves into the enemy\'s midst, detonating charges upon impact which deal massive area of effect damage and stun enemies. Upon landing, the assault deals Techies non-lethal damage equal to a percentage of their current health.','The self-damage Techies receive from this blast is pure and non-lethal.This ability destroys trees.','Where we going?','https://www.dotabuff.com/assets/skills/techies-blast-off-5601-d0fee4ded914db7a8808c83409ed9b0a600129d113cb343c90b517e81ce35b8a.jpg'),
