(626,106,'Proximity Mines','Plant an invisible mine that cannot be detected by True Sight, but is visible if an enemy is within the active 500 AoE of the mine. Mines detonate if an enemy is standing within the active AoE for 1 seconds dealing damage and temporarily reducing the enemy\'s Magic Resistance. The explosion deals full damage if the target is within 150 radius and decreases up to 50% on the edge. Deals 30% damage to buildings.','Cannot be placed within 350 AoE of another Proximity Mine.Proximity Mines do not block neutral creep camps from spawning.Mines last until they explode or are destroyed.Mines are triggered by invisible units.Grants 30 gold if destroyed by an enemy hero.Debuff immune units will reveal mines, but not trigger detonation.','The bane of Toterin!','https://www.dotabuff.com/assets/skills/techies-proximity-mines-5599-788431b6181b7f961e5e35d4ad42108de81565c0e1ed76767cc8cc7dc365e4b7.jpg'),
(627,107,'Crypt Swarm','Sends a swarm of winged beasts to savage enemy units in front of Death Prophet.','Can hit units up to 1110 range away.Does not trigger spell block or spell reflect.','Krobelus\' many trips to the grave gather a flock of the damned.','https://www.dotabuff.com/assets/skills/death-prophet-crypt-swarm-5090-7071613b265ece2333e84d30a9f9f4287645eb9339fd1931403a16ef594db2f5.jpg'),
