(630,107,'Exorcism','Unleashes evil spirits to drain the life of nearby enemy units and structures. Spirits need to return back to Death Prophet in order to attack again. At the end of the spell\'s duration, Death Prophet is healed in proportion to the damage dealt. Deals 50% damage to buildings. Lasts 40 seconds.Increases Death Prophet\'s movement speed while active.','Radius represents the area in which the spirits will acquire targets around Death Prophet.Spirit damage isn\'t reduced by damage block abilities.','Over time, the banshee remnants of her previous lives return to haunt the present.','https://www.dotabuff.com/assets/skills/death-prophet-exorcism-5093-e8ba5c401cade8481df2f164b0491eb3f7bbcba97ea779dca4f71d5d74468dc2.jpg'),
(631,108,'Nether Blast','An exploding pulse deals damage to enemies and structures in the area.  Deals 65% damage to structures.','Damage is delayed by 0.8 seconds.','The Arts of Oblivion include a deafening blast of emerald flames from the Nether Reaches.','https://www.dotabuff.com/assets/skills/pugna-nether-blast-5186-8ab0119a62c79c6dbb2ad2ea1d17520b57a92db7bd865f44cac672c70d3a71e4.jpg'),
(632,108,'Decrepify','A powerful banishing spell that slows a unit and renders it unable to attack or be attacked. Healing on affected allies is increased, while afflicted enemies take extra magic damage instead.','Only magical and pure damage can affect a unit under the effects of Decrepify.Doesn\'t slow allied units.Can be used on your Nether Ward.','A now-mastered relic from his childhood, Pugna delights in banishing others into the Nether Realm, whether for good, evil, or simple enjoyment.','https://www.dotabuff.com/assets/skills/pugna-decrepify-5187-1732e718dfd5a870957f1651c061d0a8bfdc15f2c9e3c03b746cefdb2b6d1f04.jpg'),
(633,108,'Nether Ward','Pugna places a Nether Ward at the target location. The ward will fire at any enemy hero who casts a spell dealing base damage plus the damage multiplier of the mana spent by the enemy hero.','Nether Ward deals damage before the actual spell is cast, so if the caster dies the spell will have no effect.Nether Ward can be decrepified.Illusions and creeps deal 25% damage to Nether Ward.','While at the lamasery for the Arts of Oblivion, Pugna learned to dominate his classmates with a simple ward charged with Nether magic.','https://www.dotabuff.com/assets/skills/pugna-nether-ward-5188-015dc3878fca5ecf37d9ed0ad7bd86ce2f3059c6ce4bc9a8a2146beebf129da5.jpg'),
