(635,108,'Life Drain','CHANNELED - When cast on an enemy, Pugna drains health from the target enemy unit to heal himself and granting vision over the target. If Pugna has full HP, and the enemy target is a Hero, Life Drain will restore mana instead.When cast on an ally, Pugna will drain his own health into his ally.','Illusions are destroyed on the first tick of damage.','Pugna has truly become more powerful than even the grandmaster of Oblivion.','https://www.dotabuff.com/assets/skills/pugna-life-drain-5189-89234736682cb42550075837a766372204dee97ca2d594d406b8be7cd984ad1c.jpg'),
