(639,109,'Invoke','Combines the properties of the elements currently being manipulated to create a new spell for Invoker to use. Invoke cooldown is reduced by 0.3 seconds for each orb level.  Click the help button to see the list of possible spells.','The arrangement of instances does not matter.Invoke will not cost mana or go on cooldown if the only effect is to swap the positions of existing spells.','So begins a new age of knowledge.','https://www.dotabuff.com/assets/skills/invoker-invoke-5375-262f768792aa5043ca12fd542e55e6366ed35da0fa83d826ee573a5755bc9876.jpg'),
(640,109,'Cold Snap','Invoker draws the heat from an enemy, chilling them to their very core for a duration based on the level of Quas. The enemy will take damage and be briefly frozen. Further damage taken in this state will freeze the enemy again, dealing bonus damage and healing invoker. The enemy can only be frozen so often, but the freeze cooldown decreases based on the level of Quas.','The freeze stun only triggers on damage greater than 10 after reductions.','Sadron\'s Protracted Frisson.','https://www.dotabuff.com/assets/skills/invoker-cold-snap-5376-28836ffcac617ad74634cd3f81eda5ef2bf9bdbd12f794ee8b28956a5859dff5.jpg'),
(641,109,'Ghost Walk','Invoker manipulates the ice and electrical energies around him, rendering his body invisible and gaining health and mana regen. The elemental imbalance created as a consequence slows nearby enemies based on the level of Quas, and slows Invoker as well based on the level of Wex.','The slow effect does not work on Spell Immune enemies.','Myrault\'s Hinder-Gast.','https://www.dotabuff.com/assets/skills/invoker-ghost-walk-5381-60020e46b95ce9edb180b862866df1487ab94f3a22b8b98e0b65153f9642e786.jpg'),
(642,109,'Tornado','Unleashes a fast moving tornado that picks up enemy units in its path, suspending them helplessly in the air shortly before allowing them to plummet to their doom. Travels further based on the level of Wex. Holds enemies in the air for a duration based on the level of Quas. Deals base damage plus added damage based on levels in Wex.DISPEL TYPE: Basic Dispel','Units are invulnerable while affected by Tornado, and the damage is dealt when landing.','Claws of Tornarus.','https://www.dotabuff.com/assets/skills/invoker-tornado-5382-bbe4d3855ab9d45d4fc6315055ed11f4f97a25fd1adf7720a50ac23a884e284e.jpg'),
(643,109,'E.M.P.','Invoker builds up a charge of electromagnetic energy at a targeted location which automatically detonates after 2.9 seconds. The detonation covers an area, draining mana based on the level of Wex. Deals damage for each point of mana drained.  If EMP drains mana from an enemy hero, Invoker gains 25% of the mana drained.','Will not affect cycloned units (Tornado or Eul\'s Scepter of Divinity).','Endoleon\'s Malevolent Perturbation.','https://www.dotabuff.com/assets/skills/invoker-e-m-p-5383-88e380494cbc94fecd1a5554656591537640a9bef95a47b8e632496137d69608.jpg'),
