(645,109,'Chaos Meteor','Invoker pulls a flaming meteor from space onto the targeted location. Upon landing, the meteor rolls forward, constantly dealing damage based on the level of Exort, and rolling further based on the level of Wex. Units hit by the meteor will also be set on fire for a short time, receiving additional damage based on the level of Exort.','Deals main damage to enemy units under meteor every 0.5 seconds and burns enemies for smaller damage over 3 seconds.The meteor moves at a speed of 300.','Tarak\'s Descent of Fire.','https://www.dotabuff.com/assets/skills/invoker-chaos-meteor-5385-b93d7e77232fa51479d0d1c1453d0c61bb187c055c7b05ac541ba7b809bc30d5.jpg'),
(646,109,'Sun Strike','Sends a catastrophic ray of fierce energy from the sun at any targeted location, incinerating all enemies standing beneath it once it reaches the earth. Deals damage based on the level of Exort, however this damage is spread evenly over all enemies hit.','Gives vision of the target area before the strike.Invoker gains experience with kills made from Sun Strike, even if made from outside of experience range.','Harlek\'s Incantation of Incineration.','https://www.dotabuff.com/assets/skills/invoker-sun-strike-5386-306c79e2e3c5abbab57d375043aacddafae56f347c4f769c8aefa699d239281a.jpg'),
(647,109,'Forge Spirit','Invoker forges a spirit embodying the strength of fire and fortitude of ice. Damage and armor are based on the level of Exort while attack range, health, and duration are based on the level of Quas. The elemental\'s scorching attack is capable of melting the armor of enemy heroes. Spawns two spirits when Quas and Exort are at least level 4.','Casting this ability will replace currently summoned Forged Spirits.','Culween\'s Most Cunning Fabrications.','https://www.dotabuff.com/assets/skills/invoker-forge-spirit-5387-85c20a082bc67b1892330af760affdb2ce1ccb53a1b2a90ce02f43e2028cdef9.jpg'),
