(649,109,'Deafening Blast','Invoker unleashes a mighty sonic wave in front of him, dealing damage to any enemy unit it collides with based on the level of Exort. The sheer impact from the blast is enough to knock those enemy units back for a duration based on the level of Quas, then disarm their attacks for a duration based on the level of Wex.',NULL,'Buluphont\'s Aureal Incapacitator.','https://www.dotabuff.com/assets/skills/invoker-deafening-blast-5390-050025ad4c4a95aec8fbcb2c46cb850fa2bbba51f2b5200024791492fef94a45.jpg'),
