(651,110,'Dead Shot','Muerta fires a ghostly trickshot at an enemy unit or tree. When the bullet strikes, it damages and briefly slows, then ricochets in the targeted direction.The ricochet damages all units that it passes through, stopping when it hits a hero. Heroes hit by the ricochet are feared away from the impact.','Feared enemies are phased and unslowable.The ricochet will travel 1.5x Dead Shot\'s cast range.Can ricochet off of magic immune targets.','A steady gunhand and an eternity of practice produce trickshots that defy the mortal mind.','https://www.dotabuff.com/assets/skills/muerta-dead-shot-5751-ce56e0fcab6d59041e89444f011eb8b5b0754b445bd247885a50e9ca50838dd9.jpg'),
