(653,110,'Gunslinger','Toggleable. When toggled on, Muerta\'s attacks have a chance to fire a second shot at another target.','If no other units are in range, she fires both guns at the original target.Secondary shots can hit units within Muerta\'s attack range plus 175.The secondary shot can trigger attack modifiers.','Muerta offers all of her victims Mercy. Some are fortunate enough to also earn Grace.','https://www.dotabuff.com/assets/skills/muerta-gunslinger-5753-0888674a58c0531b283b49d267160903cb9b5fa223bcb9446596e9cbdad5dc0a.jpg'),
