(655,110,'Parting Shot','Muerta precisely shoots a hero in their soul, separating it from their physical body and knocking it 150 units away.The soul is untargetable, muted, disarmed, and invulnerable for 4 seconds.The body is stunned and has 35% damage reduction for this duration.After the effect ends the hero\'s soul is forcefully returned to their body applying a strong dispel. The soul will survive until the end of the effect even if the hero is killed.','Debuff Immune units will take the damage from the shot but not be separated from their body.Allied heroes hit with Parting Shot will not be damaged.',NULL,'https://www.dotabuff.com/assets/skills/muerta-parting-shot-5760-8a0f01127d66f619edd0ef526bb77c0331cbac3d33a86084fa333d796fbc8dea.jpg'),
