(658,111,'Impetus','Places an enchantment on each attack while activated, causing it to deal additional damage based on how far away the target is.  The farther the target, the greater the damage dealt. Deals double damage to creeps and illusions.','The damage is capped at 1750 distance.Distance to target is measured when the projectile hits.','While Aiushtha favors peaceful means, she is capable of a magical onslaught from a distance, her spears gaining energy from the natural life around her.','https://www.dotabuff.com/assets/skills/enchantress-impetus-5270-fc8392bc2ac0ce2114a15292f77d0678f479bd2aa5c9bffdcdf85e75bd393277.jpg'),
(659,111,'Enchant','Enchantress charms an enemy. If the enemy is a hero, they are dispelled and slowed for 5s. If the enemy is a creep, she brings it under her control and receives 50% of their experience bounty.  Enchantress can control up to 1 creeps at a time for up to 30 / 60 / 90 / 120s. DISPEL TYPE: Basic Dispel','Illusions can be converted.','A true steward of the forest, Aiushtha befriends all within it - from lowly trolls to powerful centaurs.','https://www.dotabuff.com/assets/skills/enchantress-enchant-5268-2a63e70e5eb65e56afc44a79a487d255e5f5a19dac884023173bd8bafe6c92e9.jpg'),
