(674,113,'Starstorm','Calls down a wave of meteors to damage nearby enemy units. The closest enemy unit to Mirana in a 650 radius will be struck a second time for 75% of the damage.','Starstorm is not blocked by Linken\'s Sphere.Starstorm cannot hit invisible units.Starstorm will choose a new target for the second star if the first died before impact.','The Goddess breaks the strata to empower her Princess in the time of need.','https://www.dotabuff.com/assets/skills/mirana-starstorm-5051-d2ab4ddef1ca355b743dda705d30e4a2f9189dd6eb9cdc2fe52bb2e9e4b06176.jpg'),
