(687,115,'Refraction','Templar Assassin becomes highly elusive, gaining a small barrier and bonus to her damage.  The damage and avoidance effects are separate, and have a limited number of instances. If a barrier is consumed, a new one is created as long as there are charges left. If an instance of damage would deal more damage than the remaining barrier, all of the damage is absorbed.','Damage as HP Removal bypasses Refraction (it won\'t reduce the charges).Only instances of X or more damage will trigger Refraction.Refraction is visible to enemies.','Manipulating her psionic veil, Lanaya bends nature\'s law to her will.','https://www.dotabuff.com/assets/skills/templar-assassin-refraction-5194-eea1f1f3c9f85de9b3dde945332bbd38f1a547ee7f853ea0e9ecf6842c9d0497.jpg'),
(688,115,'Meld','Templar Assassin conceals herself, becoming invisible as long as she remains still.  If Meld\'s invisibility is broken by attacking an enemy, Lanaya will deal bonus damage to the enemy and reduce their armor for 6 seconds.','Meld is broken by any action other than staying in position or channeling Psionic Projection.Meld\'s armor reduction does not work against towers.','Lanaya is as elusive as her covenant with the Hidden Temple.','https://www.dotabuff.com/assets/skills/templar-assassin-meld-5195-d6c1744248dc2c1daf776045f14ee13a75a974b852f83e2ac20bc5a21655c8ad.jpg'),
(689,115,'Psi Blades','Templar Assassin\'s psi blades slice through the attacked unit, splitting and damaging enemy units directly behind it, while gaining bonus attack range. For each unit it damages, the spill damage is reduced by a percentage.','Split damage hits invisible units.Attack effects like Bash will only be applied to the main target.','Her blades pierce the skin as much as the mind, furthering her understanding of the mystery that is reality.','https://www.dotabuff.com/assets/skills/templar-assassin-psi-blades-5196-7bca1cb3332815e51359f661a5b78eff468ab6e2d8046c219006cc1a73118937.jpg'),
