(691,115,'Psionic Projection','CHANNELED - Allows Templar Assassin to teleport to any Psionic Trap after channeling for 2 seconds, detonating it upon arrival as if it was fully charged and instantly dealing 300 bonus damage. Channeling Psionic Projection does not break Meld.',NULL,'In reward for her service, Lanaya has been granted access to secrets that unlock new techniques for her psionic gifts.','https://www.dotabuff.com/assets/skills/templar-assassin-psionic-projection-7853-9b55de74b595777aa857e64a25aae00f7b824513ffc719ac5a96bb234de7fe8b.jpg'),
(692,115,'Psionic Trap','Templar Assassin places mystical traps that invisibly monitor enemy movement. When sprung at her command, they deal a small amount of damage and exert a slowing influence of 20% in the area. Traps charge up to slow 50% after 3.5 seconds. Deals bonus damage when fully charged.','Traps last indefinitely.They have invisibility that fades in over 2 / 2 / 2 seconds and spell immunity. They take 2 hits to kill by ranged heroes, 1 by melee heroes, and 4 by creeps.Traps have 400/400 vision range and don\'t prevent neutral camps from spawning.','Calling upon the reach of the Hidden Temple, none escape the eye of the Templar.','https://www.dotabuff.com/assets/skills/templar-assassin-psionic-trap-5197-1b957a96a466551f5ded2ff0cdc1c086cf865b1ad73b77a03c133e51f44d8fba.jpg'),
