(694,116,'Swashbuckle','Pangolier dashes along the target line, then slashes all enemies in the drawn direction with several quick swipes.Lucky Shot has a chance to activate from this damage.','Casting Swashbuckle during Rolling Thunder ends Rolling Thunder.','The Pangolier\'s blade is even nimbler than his tongue.','https://www.dotabuff.com/assets/skills/pangolier-swashbuckle-6344-f89bb7f02c482fa044dc0811150eeb515c17f1b6e874d8ba9ec604bb7c2d0603.jpg'),
(695,116,'Shield Crash','Pangolier jumps in the air and slams back to the ground in front of his current position, damaging and slowing all enemies in a radius. For each enemy hero hit, he gains an all damage shield for a short time.Forward movement is maintained if Shield Crash is used while Rolling Thunder is active, and allows Rolling Thunder to clear walls or cliffs. Shield Crash cooldown during Rolling Thunder is decreased.',NULL,'Only in the midst of his enemies does the Pangolier truly thrive.','https://www.dotabuff.com/assets/skills/pangolier-shield-crash-6461-43deef3458580323a6e9597f3792bc49d0d553db292eb4d3d7fe7677945317e4.jpg'),
(696,116,'Lucky Shot','Pangolier rolls the dice and lets fate decide the outcome for his enemies. Grants a chance to drastically slow their attack speed and reduce armor on any damage dealt by Pangolier\'s attacks or abilities.',NULL,'The Pangolier\'s blade is guided more often by whim than reason.','https://www.dotabuff.com/assets/skills/pangolier-lucky-shot-7307-8c0559b08e2e056071d323473c6da039383122ae725e21b88f4cb7f26839ad15.jpg'),
