(699,116,'Rolling Thunder','Pangolier curls into a debuff immune ball with 60% additional magic resistance and rolls out. When rolling, he moves at an increased speed and can move through trees, but has a decreased ability to turn. Striking enemies knocks them back, inflicting damage proportional to his attack damage and stunning them when they land. Colliding with walls or cliffs will cause a temporary pause while Pangolier reverses in direction. During Rolling Thunder, Shield Crash cooldown is reduced.DISPEL TYPE: Basic Dispel','Enemies can be stunned multiple times per use, but cannot be affected a subsequent time until the previous stun duration ends.If Pangolier is disabled while rolling, he will continue to stun and knock enemies that come within range.','Where his ancestors sought only refuge, the Pangolier saw opportunity...','https://www.dotabuff.com/assets/skills/pangolier-rolling-thunder-6343-2feedd85dffd9a9749ad7a6cee87b708d51be92c22fa95d8d46d60f65e558a9d.jpg'),
