(708,118,'Reflection','Terrorblade brings forth an invulnerable dark reflection of all enemy heroes in a target area. Affected enemy heroes have movement and attack speeds slowed and attacked by their reflection.','Reflections are untargetable, invulnerable illusions, that will be destroyed if the slow debuff is removed.Reflections can only attack their source.','In the fractal prison of Foulfell, Terrorblade learned the truth of this old tale: you are your own worst enemy.  Now it is a lesson he teaches others.','https://www.dotabuff.com/assets/skills/terrorblade-reflection-5619-669867b9b9041170a912f3617f99ac9ed43fec88d23e270f04f0e97e29e107ca.jpg'),
