(710,118,'Metamorphosis','Terrorblade transforms into a powerful demon with a ranged attack. Any of Terrorblade\'s illusions that are within 1200 range will also be transformed by Metamorphosis.','Cooldowns of items that are different for ranged and melee units will be based on which form Terrorblade was in when the item was used.','Temper, temper. The rage rises up and takes control.  Meet Terrorblade\'s own worst self.','https://www.dotabuff.com/assets/skills/terrorblade-metamorphosis-5621-4d1538c5c81f153af768f04bcae550041575e3ea7082716c9f93e320666e25c0.jpg'),
