(715,119,'Torrent','Summons a rising torrent that, after a short delay, hurls enemy units into the sky, stunning, dealing damage and slowing movement speed.','The initial bubble effect is only visible to allies and provides vision in fog of war.Units tossed in the air will be stunned and still able to be attacked.','An ancestral rush of water explodes from the center of the world, called upon by the Admiral.','https://www.dotabuff.com/assets/skills/kunkka-torrent-5031-1b5d665d127ea76b7c9330507dc1d39315c9aa9cd6aed7f030adab7b02a6d709.jpg'),
(716,119,'Tidebringer','Kunkka\'s legendary sword grants increased damage and cleaves a large area of effect in front of him for a single strike.',NULL,'A lost Claddish soul inhabits Kunkka\'s trusty Tidebringer, empowering it to destroy demons of the Cataract.','https://www.dotabuff.com/assets/skills/kunkka-tidebringer-5032-391cdee575317c10ec68f75f12125c7367811271a57389ff3295c3ae9ef22289.jpg'),
(717,119,'X Marks the Spot','Targets a friendly or enemy Hero, marks their position with an X, and returns them to it after several seconds.  Kunkka can trigger the return at any time during the duration. Lasts twice as long on allied heroes.','Interrupts channeling spells.','The Admiral\'s set of arcane abilities includes some that can be used for battle as well as entertainment.','https://www.dotabuff.com/assets/skills/kunkka-x-marks-the-spot-5033-641d5555f6d74427f4b9adfe55b4d5c00a39793c94e76170829c8f9d1d64c905.jpg'),
