(719,119,'Tidal Wave','Releases a Tidal Wave that spawns behind Kunkka. Deals damage and drags enemies along it for the duration. Enemies cannot attack while being dragged.',NULL,NULL,'https://www.dotabuff.com/assets/skills/kunkka-tidal-wave-605-d9dd4a60675123c87a87cdec60e6233c717c790f6286bf588ff3acd05828c0db.jpg'),
