(723,120,'Teleportation','Teleports to any point on the map. Gains a barrier after arriving to its destination.','Mana and cooldown take effect when the cast is completed.  Nature\'s Prophet will not use any mana or waste the cooldown if the spell is interrupted while casting.When the cast begins, an effect is created at the target location, which is visible to allies and enemies.','The Prophet keeps his sentinel over the forest, protecting it when in need.','https://www.dotabuff.com/assets/skills/natures-prophet-teleportation-5246-ed64118dbd7edd44ec04b3c54c4dbf7a9b36f913886e74115f0317dfcc0492b7.jpg'),
(724,120,'Nature\'s Call','Converts an area of trees into Treants under the command of Nature\'s Prophet.','Nature\'s Call can only create as many treants as there are trees in the target area.','Verodicia bestowed the Prophet with the ability to summon the Treant Guard, a mythical sentient army of the wild.','https://www.dotabuff.com/assets/skills/natures-prophet-natures-call-5247-7a79d03b0ec65a51e185449921d68b74c1d17b08301452507c29b7a6f241f597.jpg'),
(725,120,'Curse of the Oldgrowth','Applies a curse on all enemy heroes within 1200 range, displaying them in fog, slowing them, and causing damage over time based on the number of trees within 250 radius. Treants count as trees for this purpose.',NULL,'Though powerful, Nature\'s Prophet\'s gifts do not include all-sight, and he must rely heavily upon reconnaissance and aid from a long-standing network of stalwart friends.','https://www.dotabuff.com/assets/skills/natures-prophet-curse-of-the-oldgrowth-997-8d91dd12fc28d85fabd56e43148f6cd26078450fb1b8916446e8141fc8575a0b.jpg'),
(726,120,'Spirit of the Forest','Nature\'s Prophet gains 2 / 3 / 4 / 5 / 6% bonus damage for each tree within 300 and a multiplier of that same bonus for each treant within 1200 distance of him.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(727,120,'Wrath of Nature','Damaging energy bounces around the map, striking enemies close to the cast point that are in vision. Each enemy hit beyond the first adds damage, up to the maximum after 16 are hit.','Wrath of Nature will not hit units out of vision.Can be cast through the minimap; the nearest valid target will be selected.','Nature\'s Prophet calls Verodicia\'s fury to strike down those who might ravage the wilderness.','https://www.dotabuff.com/assets/skills/natures-prophet-wrath-of-nature-5248-9f276a46723bc45e8133f4f942a2d0cf344d26cf2877ccfa17078a013235b4eb.jpg'),
(728,121,'Ice Shards','Tusk compresses shards of ice into a ball of frozen energy that damages all enemies it comes in contact with. When the ball reaches its target destination the shards are released, creating a barrier that lasts for 4 / 5 / 6 / 7 seconds.','Creates an impassable barrier.','In the frozen tundra near the Barrier, after the last sun of autumn has set, ice can form with alarming speed.','https://www.dotabuff.com/assets/skills/tusk-ice-shards-5565-26fb856c7ec9d5a0ee58af686549052b6a83f3fc92fcdb59f122d4d94ca4d380.jpg'),
(729,121,'Drinking Buddies','Tusk reaches out to tag an allied unit, pulling them closer. Once tagged, both Tusk and his tagged ally gain movement speed and attack damage. Can be put on alt-cast to only pull Tusk towards his ally.','Doesn\'t pull Tusk or targeted ally if they are within 250 range of each other.Cannot be used during Snowball.',NULL,'https://www.dotabuff.com/assets/skills/tusk-drinking-buddies-1385-46a68b6da37d22d588e27a2b4c3aa644b5e322450913bfc080a5429cd496751d.jpg'),
(730,121,'Snowball','Tusk begins rolling into a snowball. Allies within a 350 radius can also be added to the snowball by right-clicking on them, even while the snowball is moving. Once launched, any enemies caught in the snowball\'s path will be stunned and take damage. Each allied Hero in the snowball will add to its damage.','The snowball will break apart a maximum of 3 seconds after launch.The snowball can be launched early by pressing using the Launch Snowball ability.Doesn\'t carry illusions, but will carry Meepo clones and other units that Tusk controls.Each Meepo clone added to the snowball will add its own bonus damage.Allies can click on a snowball to add themselves to it.','Tales are still told of the wild feat that ended the grand brawl at White Fields.','https://www.dotabuff.com/assets/skills/tusk-snowball-5566-e66e26e8246ee43ef23b31965997de51384d35afbdabdef64297ca0227abd45f.jpg'),
(731,121,'Tag Team','Activate to temporarily apply a negative debuff aura around you, causing enemies that are attacked under it to take bonus physical damage and reduced movement speed. Lasts 6 seconds.','Affects attacks from allied heroes, Tusk or any of his units.','Even far from Cobalt, Tusk carries the \'Barrier Chill\' in his very bones.','https://www.dotabuff.com/assets/skills/tusk-tag-team-7322-8ed62be15e3bdfbb11c7da1eeeacaf371dc9aa88b6b01ca9b0efd59a69d6f02d.jpg'),
(732,121,'Walrus Kick','Kicks the closest enemy unit in the drawn direction, stunning, damaging, and slowing them. Also deals damage to all heroes within 250 radius of its landing area. Cooldown is reduced by 50% if kicking a creep.',NULL,'Tusk may have made his name with his fists, but the wise enemy is wary of any and all limbs.','https://www.dotabuff.com/assets/skills/tusk-walrus-kick-5672-b0126f77ce5b544e94b9d1d5863c3cbafee44443074a3f0ba14dda75aa0093b0.jpg'),
(733,121,'Bitter Chill','Passively slows the attack speed of all enemies within 350 radius.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(734,121,'Walrus PUNCH!','Tusk connects with his mighty Walrus Punch, a critical strike with bonus damage so powerful it launches its victim into the air.','Walrus PUNCH has true strike.','It never matters who throws the first punch, only who throws the last.','https://www.dotabuff.com/assets/skills/tusk-walrus-punch-5568-ad929d6a87e47c23ffa4b1707f6bd547559480df840f1d581ec88def4bb0f28a.jpg'),
(735,121,'Launch Snowball','Launch the snowball toward the target.','The snowball destroys trees.Doesn\'t carry illusions, but will carry Meepo clones and other units that Tusk controls.Each Meepo clone added to the snowball will add its own bonus damage.','Into the great wide white!','https://www.dotabuff.com/assets/skills/tusk-launch-snowball-5641-140a557f211aa2f440a420108dac6063223115ec172edb8a54ab32ebd3d3d368.jpg'),
(736,122,'Waveform','Morphling dissolves into liquid and surges forward, damaging enemy units in his path.  Morphling is invulnerable during Waveform and attacks all enemies it goes through with a penalty.','Attack does not apply on hit effects without the talent.','A torrential flood takes enemies by force.','https://www.dotabuff.com/assets/skills/morphling-waveform-5052-64fa2168eb9e050b514dac5fc69a5ce57ff4208e02ed3b793918cc4ff88fe861.jpg'),
(737,122,'Adaptive Strike (Agility)','Launches a surge of water toward an enemy unit, dealing base damage plus additional damage based on Morphling\'s agility times a multiplier.  If Morphling\'s agility is 50% higher than strength, the maximum agility multiplier is used.  Also puts Adaptive Strike (Strength) on a 3 second cooldown.','Projectile moves at 1150 speed.','The Morphling calls upon his elements to crush his opponents with waves.','https://www.dotabuff.com/assets/skills/morphling-adaptive-strike-agility-5053-0bba04d28d88185c8c2068964e302782b92d2476fde2c3a530db04172c1f09b2.jpg'),
(738,122,'Adaptive Strike (Strength)','Launches a surge of water toward an enemy unit, stunning the target based on Morphling\'s strength. If his strength is 50% higher than his agility, the maximum stun is dealt.  Also puts Adaptive Strike (Agility) on a 3 second cooldown.','Projectile moves at 1150 speed.','The Morphling calls upon his elements to crush his opponents with waves.','https://www.dotabuff.com/assets/skills/morphling-adaptive-strike-strength-7000-c2c4e6685192ef48ed931c38bc9b543c8f2cb1f86c0c6d2c88d76b09855fba26.jpg'),
(739,122,'Attribute Shift (Agility Gain)','Morphling shifts its form, pulling points from Strength and pouring them into Agility. The process is reversible.  Additional points in Attribute Shift increase the rate of stat change.','Attribute Shift can\'t convert stats from items.Leveling up Agility Gain will also level up Strength Gain.','Shifting water makes it difficult to discern the nature of Morphling.','https://www.dotabuff.com/assets/skills/morphling-attribute-shift-agility-gain-5055-065d1f9878534a973ac6590ba456e4d24be0e6d3de0d1fced70c4ecf1f5c8174.jpg'),
(740,122,'Attribute Shift (Strength Gain)','Morphling shifts its form, pulling points from Agility and pouring them into Strength. The process is reversible.  Additional points in Attribute Shift increase the rate of stat change.','Attribute Shift can\'t convert stats from items.Leveling up Strength Gain will also level up Agility Gain.','Shifting water makes it difficult to discern the nature of Morphling.','https://www.dotabuff.com/assets/skills/morphling-attribute-shift-strength-gain-5056-b48d1427a060f4901c8f1146b22bfbba11552987da41946f86f8b67084539a4b.jpg'),
(741,122,'Morph','Morphling changes his form to match the targeted enemy, gaining their basic abilities. Can be toggled for the duration of the ability.','You can\'t target yourself with Morph.Morph won\'t copy Shard/Scepter abilities unless Morphling owns the respective item.Does not trigger spell reflect.','Staring into Morphling produces a reflection that mimics the beholder.','https://www.dotabuff.com/assets/skills/morphling-morph-5057-d77cd2feac1abb234b31e3c31e950faa670f091596c1dd63cc78fd51c3b4ac30.jpg'),
(742,122,'Morph Replicate','Toggles Morphling\'s form between his own and the replicated enemy.',NULL,NULL,'https://www.dotabuff.com/assets/skills/morphling-morph-replicate-5058-1e6855de8f285dc528ce279b94d4647f4ad95c4673f500450b3a980c373a6ca4.jpg'),
(743,122,'Accumulation','Morphling receives 50% of stat growth bonuses every half level instead of the full bonus at level up. Morphling receives +100% bonus stats from All Attributes bonus from skill points in the Talent Tree.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(744,123,'Penitence','Forces an enemy unit to move slower and for allies to attack it more quickly. Chen can attack the Penitence target with bonus attack range.',NULL,'Although Chen\'s brand of animal enthrallment isn\'t quite strong enough to control the minds of enemy heroes, it still tests their resolve in combat.','https://www.dotabuff.com/assets/skills/chen-penitence-5328-deca423b0ba7c06d2032d13476c33496e3bec99e45ad0b8a41bc160731f7bc3a.jpg'),
(745,123,'Holy Persuasion','Chen takes control of an enemy or neutral creep and receives a percentage of its bounty. Its maximum health is set to 400 + 50 per Chen Level. Converted creeps will have increased movement speed and bonus damage.','Persuading a new creep above max unit count causes the oldest persuaded creep to die.Can target Ancient creeps when Chen has Aghanim\'s Shard.The health of creeps already under Chen\'s control does not update to the new level upon leveling Holy Persuasion further.Fully restores the creep\'s mana upon converting.','Although they may not be knights, Chen incorporates beasts into the Fold in the same way he himself was converted.','https://www.dotabuff.com/assets/skills/chen-holy-persuasion-5330-dd79804b2818d059d504e3ce4287975fe6d53afd34660ee0e655849bd7b399d9.jpg'),
(746,123,'Divine Favor','Passively provides an aura that grants increased health regeneration. Can be cast on allies to provide them with bonus armor and increasing the healing and health regeneration they receive.If cast on Chen, all units controlled by Chen will be teleported to him. Taking damage from enemy heroes or their units will cancel the teleport.',NULL,'Chen\'s zeal is infectious, blessing his allies with vitality and compelling them to his side.','https://www.dotabuff.com/assets/skills/chen-divine-favor-7306-da5c070dab7ebab5745d0c717cca5ee52ab50209d5237eb750be5a04a8a8c93f.jpg'),
(747,123,'Summon Convert','Chen summons a convert to fight for him. The convert gains bonuses from Holy Persuasion and dies if Chen dies. Its maximum health is set to 220 + 80 per Chen Level. The spell stays on cooldown while the convert is alive, but refreshes whenever Chen respawns. The Convert counts towards Holy Persuasion max unit count.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(748,123,'Hand of God','Heals all allied heroes on the map as well as all units under Chen\'s control. A large heal is applied at first and a slow heal over time is applied for 10 seconds afterwards.','Can heal invulnerable and hidden/banished allies.','Using the mental link with his thralls, Chen calls down restoration and well-being to those who share his fanaticism.','https://www.dotabuff.com/assets/skills/chen-hand-of-god-5331-c4879212abe6d2039ea7265091c3cc4ee5443876a2435298fb9b57998a909225.jpg'),
(749,124,'Sticky Napalm','Drenches an area in sticky oil, amplifying damage from Batrider\'s attacks and abilities and slowing the movement speed and turn rate of enemies.  Additional casts of Sticky Napalm continue to increase damage, up to 10 / 10 / 10 / 10 stacks. Applies a small amount of damage with each cast.','All damage from Batrider gets amplified, except for Radiance, Orb of Venom, Urn of Shadows, and Spirit Vessel.Sticky Napalm does not require turning to cast.Sticky Napalm deals 20% damage to creeps.','It\'s not uncommon to hear the Rider cackle while he increases the flammability of his opponents.','https://www.dotabuff.com/assets/skills/batrider-sticky-napalm-5320-b61ba48f3ccd2360420659ca961be270184c87aac268b47490a0d0b2a63b27d3.jpg'),
(750,124,'Flamebreak','Hurls an explosive cocktail that explodes when it reaches the target location, knocking back, slowing and dealing damage over time to enemies in the area.',NULL,'A molotov cocktail is the weapon of choice for Batrider.','https://www.dotabuff.com/assets/skills/batrider-flamebreak-5321-75a1e7d8c75ec8220ec5646c9a41dd4307294aa088590d04e08b5dcf6d9a0bdf.jpg'),
(751,124,'Firefly','Batrider takes to the skies, laying down a trail of flames from the air.  The fire damages any enemies it touches, and destroys trees below Batrider.','During this the Batrider can fly above units, trees and impassable terrain.If duration ends when above impassable terrain, the Batrider can get stuck.The trail persists through Batrider\'s death.','When an enemy escapes into the Yama Raskav Jungle, most would cut through the brush to find the fugitive.  Batrider just chooses to destroy the jungle along with his foes.','https://www.dotabuff.com/assets/skills/batrider-firefly-5322-3008d3e4bd9a83e69167c72f45b69cde9170240c0e3c68956f3c9ad30de2549c.jpg'),
(752,124,'APPLICATION DAMAGE:',NULL,NULL,NULL,'https://www.dotabuff.com/assets/skills/batrider-application-damage-976-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(753,124,'Smoldering Resin','Batrider\'s attacks apply a debuff that deals 15% of the attack damage every 1s for 2s.',NULL,NULL,'https://www.dotabuff.com/assets/skills/default-5a612c460046882c6741f2fd3db0f48ae721d557d613f3dc4db7262a1bd5864a.jpg'),
(754,124,'Flaming Lasso','Lassoes an enemy and drags them in Batrider\'s wake. Dragged units cannot move, attack, or use abilities.  Teleporting or blinking will break the lasso.','Killing the target or the Batrider will break the lasso before its expiration.If Batrider moves more than 425 units in 0.05 seconds the lasso breaks.Batrider cannot attack while using Flaming Lasso.','Few dare to ask to ride on the bat, as Batrider gives them free of charge.','https://www.dotabuff.com/assets/skills/batrider-flaming-lasso-5323-defeee04d229a8233c69b958473bb689f459276b29240a6edc5478d27fe20966.jpg');
